insert  into `BlogDetails`(`id`,`pageTitle`,`metaTitle`,`metaDescription`,`pageUrl`,`content`,`isEnable`,`footerCategory`,`createdAt`,`updatedAt`) values 
(1,'Test Page','Test','Test Page','test-page','<p><img src=\"data:image/jpeg;base64,\"></p><p><br></p><h1>Test Page</h1><p><br></p><h2>Algodonales</h2><p><br></p><p><strong>Algodonales</strong> is a city located in the province of <a href=\"https://en.wikipedia.org/wiki/C%C3%A1diz_(province)\" rel=\"noopener noreferrer\" target=\"_blank\">Cádiz</a>, Spain. According to the 2002 <a href=\"https://en.wikipedia.org/wiki/Census\" rel=\"noopener noreferrer\" target=\"_blank\">census</a>, the city has a population of 5,607 inhabitants. The nearest cities are <a href=\"https://en.wikipedia.org/wiki/Zahara_de_la_Sierra\" rel=\"noopener noreferrer\" target=\"_blank\">Zahara de la Sierra</a> and <a href=\"https://en.wikipedia.org/wiki/Olvera\" rel=\"noopener noreferrer\" target=\"_blank\">Olvera</a>. Algodonales is located in the <a href=\"https://en.wikipedia.org/w/index.php?title=Sierra_de_Lijar&amp;action=edit&amp;redlink=1\" rel=\"noopener noreferrer\" target=\"_blank\">Sierra de Lijar</a> within the <a href=\"https://en.wikipedia.org/wiki/Sierra_de_Grazalema\" rel=\"noopener noreferrer\" target=\"_blank\">Sierra de Grazalema</a>.</p>',1,'Experience','2020-09-12 04:46:18','2020-11-17 06:17:12'),
(2,'Retreat Cancellation Policy','Retreat Cancellation Policy','Retreat Cancellation Policy','retreat-cancellation-policy','<h1>Retreat Vegvisits service fee and cancellation policy</h1><p>&nbsp;</p><p>Receives a 14% commission on the total price of the retreat.</p><p>The commission is immediately collected as a deposit from the participant. It is up to the Host to collect the remainder of the retreat balance through the normal registration process.</p><p>&nbsp;</p><p>Need to collect the following information for retreat hosts: Your registration list will include all the information you need to connect with your registrations; name, date registered, program, stay dates, contact email, balance due after deposit payment, and their total registration amount.</p><p>&nbsp;</p><h2>Cancellation policies for Freemium Accounts</h2><p>Freemium Users (Marketplace-only Hosts) may select one of the following cancellation policies to be in effect for all Marketplace registrations associated with their Account:</p><h2>Flexible</h2><p>●&nbsp;&nbsp;&nbsp;&nbsp;100% refund of monies paid if canceled 30+ days before the start date.</p><p>●&nbsp;&nbsp;&nbsp;&nbsp;50% refund of monies paid if canceled 15-29 days before the start date.</p><p>●&nbsp;&nbsp;&nbsp;&nbsp;0% refund of monies paid if canceled less than 15 days before the start date.</p><p>&nbsp;</p><h2>Moderate</h2><p>●&nbsp;&nbsp;&nbsp;&nbsp;100% refund of monies paid if canceled 60+ days before the start date.</p><p>●&nbsp;&nbsp;&nbsp;&nbsp;50% refund of monies paid if canceled 30-59 days before the start date.</p><p>●&nbsp;&nbsp;&nbsp;&nbsp;0% refund of monies paid if canceled less than 30 days before the start date.</p><p>&nbsp;</p><p>If you, as a Freemium User, cancel an event, you must reimburse the Retail User in full within 14 days of receiving the cancellation notification. You must also contact us to request that we refund the Retail User’s deposit</p><p>&nbsp;</p><p>Bookretreats.com takes a 18% service fee.</p><p>Host set the deposit amount and anything over 18% is given to the host at the time of guest booking. All additional payment is handled by the host.</p><p>&nbsp;</p><h2>The cancellation policies are as follows:</h2><p>&nbsp;</p><p><strong>1.&nbsp;&nbsp;&nbsp;Free</strong></p><p>○&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;100% deposit refund for cancellation 1+ days before the retreat start date. The remaining balance is due upon arrival.</p><p>If paid at the time of booking, a full refund of the remaining balance is available up to the day before your retreat start date.</p><p>Please note: For deposit and remaining balance amounts, refer to your booking summary email.</p><p>&nbsp;</p><p><strong>2.&nbsp;&nbsp;&nbsp;Flexible</strong></p><p>○&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;100% deposit refund for cancellation 30+ days before retreat start date.</p><p>○&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;50% deposit refund for cancellation 15-29 days before retreat start date.</p><p>○&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;0% deposit refund for cancellation 0-14 days before retreat start date.</p><p>The remaining balance is due upon arrival.</p><p>If paid at the time of booking, a full refund of the remaining balance is available up to the day before your retreat start date.</p><p>Please note: For deposit and remaining balance amounts, please refer to your booking summary email.</p><p><br></p><p><strong>3.&nbsp;&nbsp;&nbsp;Moderate</strong></p><p>○&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;100% deposit refund for cancellation 60+ days before retreat start date.</p><p>○&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;50% deposit refund for cancellation 30-59 days before retreat start date.</p><p>○&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;0% deposit refund for cancellation 0-29 days before retreat start date.</p><p>Remaining balance is due 30 days before the retreat start date.</p><p>○&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;If paid at the time of booking, a full refund of the remaining balance is available up to 30 days before your retreat start date. If you cancel 0-29 days before your retreat start date remaining balance is not refundable. Please note: For deposit and remaining balance amounts, please refer to your booking summary email.</p><p>&nbsp;</p><p><strong>4.&nbsp;&nbsp;&nbsp;Custom - Defined by the retreat owner.</strong></p>',1,'Vegvisits','2021-07-30 05:55:52','2024-01-05 05:34:17'),
(3,'Test 3','Test 3','t3','test-3','<p><img src=\"https://vegvisits.nyc3.digitaloceanspaces.com/images/contentManagement/5882f5aacd0e10b373301b52f94f55bf.png\"><img src=\"https://vegvisits.nyc3.digitaloceanspaces.com/images/contentManagement/5882f5aacd0e10b373301b52f94f55bf.png\"></p>',1,'Experience','2021-08-10 11:37:05','2021-08-10 11:37:05'),
(4,'Test 4','Test 4','t4','test-4','<p><img src=\"https://vegvisits.nyc3.digitaloceanspaces.com/images/contentManagement/04796e6116a08f256af60d20a7251d7b.png\"></p>',1,'Experience','2021-08-10 11:41:22','2021-08-10 11:57:37');
