(35,128,'[{\"type\":\"76\",\"price\":\"426\",\"seasonal_pricing\":[],\"deposit_percent\":\"15\",\"description\":\"<p>Just down from the Main House, our Garden Cottage has four bedrooms - two set up as doubles (with double four-posted beds) and two as twins.</p><p>Each room has a cute mezzanine level which can be a lovely meditation spot. Each room has a private bathroom with free standing bathtub and (in-bath) shower.</p><p>The rooms open on to small but pretty little gardens, each private and with views across the tops of the trees and down towards the lake.</p>\",\"photos\":[{\"name\":\"d4bbf12a2c3b11e522e8c633409c922c.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"163669140c0e0f8e6f342340fab7f023.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"8f58908d681d1cf9ecedffabb4a22c6f.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"1c082bbf78af2f7ee49bb3bcf59e323d.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"fc5889ec976f77e692de089f143d83cb.jpeg\",\"type\":\"image/jpeg\"}]},{\"type\":\"77\",\"price\":\"711\",\"seasonal_pricing\":[],\"deposit_percent\":\"15\",\"description\":\"<p>The same as our rooms for single guests, our Garden Cottage rooms are cosy, comfortable and perfect spaces to rest.</p><p>Each room has a cute mezzanine level with extra single bed or serving just a cool meditation spot. Each room has a private bathroom with free standing bathtub and (in-bath) shower.</p><p>The rooms open onto small but pretty little gardens, each private and with views across the tops of the trees and down towards the lake.</p>\",\"photos\":[{\"name\":\"b33e285c0d26f3160d05086881836489.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"e4fc25eb39a6eba830649f2adec95173.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"5a369539890b28f674f8c16bc6ac6a43.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"80dc24c6f3ae8ca7bfca3a02457f746a.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"9092e9dfdcecd269823f25b43c048301.jpeg\",\"type\":\"image/jpeg\"}]}]','[{\"name\":\"ROSE MANOHARAN\",\"email\":\"rose@mail.com\",\"is_yoga_alliance\":false,\"about\":\"<p>Rose has been practising yoga for six years and is a YTT 200-qualified instructor. Originally from Kandy, close to Rukgala, she studied in Dubai but is now happily returned to Sri Lanka and, as one of the very few local female instructors, is working to encourage others to explore routes into yoga teaching.</p>\",\"photos\":[{\"name\":\"07654fa5faa997368aad7f783492d570.jpeg\",\"type\":\"image/jpeg\"}],\"location\":{\"country\":\"US\",\"street\":\"624 Skyrim Ave, Las Vegas, Nevada, zip 65876\",\"buildingName\":\"\",\"city\":\"Salt Lake City\",\"state\":\"UT\",\"zipCode\":\"\",\"zipcode\":\"65876\"}},{\"name\":\"EMMA SHERIDAN\",\"email\":\"emma@mail.com\",\"is_yoga_alliance\":false,\"about\":\"<p>I am a Yoga teacher and&nbsp;Reiki&nbsp;practitioner, based in beautiful&nbsp;Sri&nbsp;Lanka&nbsp;since 2016.</p><p>For the past 10 years, I have been facilitating classes, workshops, and retreats around the world - Yoga has been the vessel that has transported me to teach in more than 10 countries - from Dubai and Morocco to The Philippines and India!</p>\",\"photos\":[{\"name\":\"6b6331dc9c5d5cb75024d19331387cb4.jpeg\",\"type\":\"image/jpeg\"}],\"location\":{\"country\":\"US\",\"street\":\"624 Skyrim Ave, Las Vegas, Nevada, zip 65876\",\"buildingName\":\"\",\"city\":\"Salt Lake City\",\"state\":\"UT\",\"zipCode\":\"\",\"zipcode\":\"65876\"}}]','Retreat','3','4 Day Yoga, Paddleboarding, Massage & Hiking Retreat in Sri Lanka','Platform 1, Station Rd, Kandy, Sri Lanka','LK','Station Road','Kandy','2024-02-14 01:50:09','2024-02-14 01:50:09',1,NULL,'7.2889142','80.6299326','[226,223,221,222,217,220]','<p>Come to the hills and spend an early morning paddling on the lake as the sun rises up over the Knuckles Mountains. Join us in our beautiful jungle Shala for calmly guided classes that develop and refresh your own practice.</p><p>Explore a very real side of this beautiful island with guided walks through local villages to hilltop temples and up into the foothills of the mountains that surround Ruk.</p><p>Enjoy carefully considered, fresh Sri Lankan dishes, all making the most of the delicious ingredients readily available nearby.</p><p>Relax and refresh with massage treatments from our own carefully-trained local therapists.</p><p>In the hills close to Kandy, we love this gorgeous but untouched part of Sri Lanka. We\'d love you to experience it with us.</p>','[243,240,241,280]','[248]','<ul><li>Being in a space that\'s unique and different and calmly away from more touristy parts of Sri Lanka</li><li>2 expertly guided daily yoga classes in a gorgeous Shala</li><li>A guided hike up to the rock temples of Bambaragala</li><li>A 60 minute full body therapeutic massage</li><li>Being able to explore a real side of Sri Lanka - on foot, on a bike, on a paddle-board</li><li>Carefully considered food and drink</li><li>Generous touches like cooling King Coconuts after morning yoga</li><li>Beautifully prepared rooms to rest</li><li>A warm and friendly team to welcome you</li></ul><p><br></p>','<p>Your time with us at Ruk may look like...</p><p><br></p><p><strong>Morning Hatha Yoga</strong></p><p>You start each day (unless heading for a sunrise paddle on the lake) with a guided Vinyasa class at 8 am. Rose will lead you through an energizing practice to lift you into the day.</p><p><br></p><p><strong>A slow and easy breakfast</strong></p><p>After yoga enjoy a sumptuous (but healthy!) breakfast looking across the treetops and to the lake. Breakfasts are a delicious mix of Sri Lankan and Western creations.</p><p><br></p><p><strong>Time to relax</strong></p><p>Late mornings make a great time to fully relax, either by the pool, with our guys on hand to serve cooling drinks, or down by the lake, taking a paddleboard out on the calm morning water and exploring little islands easily reached.</p><p><br></p><p><strong>Explore</strong></p><p>You may choose to head out with your own naturalist and guide, walking through quiet villages to the rock temples and monastery at Bambaragala. The adventurous can climb higher and up to the stunning viewpoint on top of Pettigala - looking right across Victoria and to the Knuckles.</p><p><br></p><p><strong>Afternoons</strong></p><p>Relax in the afternoon, perhaps booking a restorative massage with one of our own local therapists. We have worked hard to train local ladies from the village in simple but healing massage techniques.</p><p>Or try a cooking class - we have developed a simple but fun class in our boat shed by the lake; one of the local teams from the nearby village shows off the best of Sri Lankan dishes with a delicious introduction to the style.</p><p><br></p><p><strong>Art therapy</strong></p><p>We have teamed up with a Kandyan artist and teacher to offer a semi-guided art class. With all the materials and simple instruction provided remotely, you can explore a skill you maybe didn\'t know you had. The main deck, looking across jungle tree-tops to the mountains is an ideal setting.</p><p><br></p><p><strong>Afternoon tea</strong></p><p>For those who haven\'t ventured out from Ruk, we tend to meet up in the late afternoon for tea and a light snack, sharing news of the day and just catching up with new friends.</p><p><br></p><p><strong>Evenings</strong></p><p>From 6 pm (or sometimes slightly later) they draw the day in with a calming Yin class. A candlelit walk back to the house brings you up to a delicious dinner of Sri Lankan dishes. Nights are not often too late at Ruk but for those wanting to hang out a little more we\'ll light the fire in the fire-pit down by the pool.</p>','[325,326,327]',NULL,NULL,NULL,3,1,1,'[{\"name\":\"60min massage\",\"price\":\"20\"},{\"name\":\"Extra day/night\",\"price\":\"30\"}]','yes','no',NULL,NULL,'<p>Rukgala lies around 45 minutes east of Kandy, pretty much in the middle of Sri Lanka. We\'re on the shores of the Victoria Reservoir, lying in between small villages and other folks along the edge of the \'lake\'.</p><p>We\'re technically on the fringe of Sri Lanka\'s Dry Zone, but at an altitude of around 600m, the weather is rarely uncomfortably hot. From Ruk you can see the peaks of The Knuckles Mountains and the tea estates that cover the foothills.</p>',NULL,'[\"A/C in Rooms\",\"Free Wifi\",\"Restaurant\",\"Pool\",\"Library\"]','<p>The lake level goes up and down through the year. In the dry season, typically from early April the level can get pretty low so to take a paddle-board down is a bit more of a walk. It very rarely dries entirely.</p><p>After the rainy season it reaches right up to our boundary.</p>',NULL,NULL,'[10,15,12,13]','203','[166,163,324]','[135,136]','[173,174,175]','[341,340,344]',4,'<p><strong>How you fill the day is up to you but you might like...</strong></p><p><br></p><p>Coffee and fresh fruit in the library looking out over the jungle as the sun comes up before yoga.</p><p>An energising Vinyasa class to lift you into the day followed by a delicious breakfast.</p><p>A walk through the village to the monastery and cave temples at Bambaragala or...just relax by the pool.</p><p>Head to the lake with Akash or one of the team and paddle out to little islands or around the headland.</p><p>As the day warms up retreat to the cool of our main deck and explore an art practice with a simple guided art therapy, or arrange a Sri Lankan cooking class with Kumari in our re-styled boat-shed.</p><p>If that\'s all too much, unwind with a massage treatment from Janaki or one of our local team.</p><p>Ease down into the evening with a soothing and gentle Yin class as the sun sets.</p>','Custom','CP','[]','<h3><strong>Arrival By Train</strong></h3><ul><li>Taking the train from Colombo to Kandy is a good way to reach Rukgala Retreat.</li><li>From Kandy Train station we are about a 45 minute ride. Taxis or Tuk Tuks cost around LKR 5,000 (approx. USD 30).</li></ul><p><br></p>',1,NULL,0),
(36,129,'[{\"type\":\"77\",\"price\":\"1626\",\"seasonal_pricing\":[],\"deposit_percent\":\"15\",\"description\":\"<p>Our private accommodation offers you a tranquil, rejuvenating, home away from home experience. The room has its own bathroom and a small porch with hammock &amp; seats overlooking the pool. The bedroom has a comfortable king size bed and a flat screen TV. Air-conditioning is provided to ensure your comfort during hot days, and of course, you\'ll enjoy free WiFi.</p>\",\"photos\":[{\"name\":\"949fc83899c78ef66d7d163e13f5852e.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"f4e97e191d84cba5f6f7ecd7b36b51bb.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"7285d406e51ad6cb68b30d549f46aad6.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"2c2efd8bc248008b03e970fae188a3d4.jpeg\",\"type\":\"image/jpeg\"}]},{\"type\":\"77\",\"price\":\"2581\",\"seasonal_pricing\":[],\"deposit_percent\":\"15\",\"description\":\"<p>Our private accommodation offers you a tranquil, rejuvenating, home away from home experience. The room has its own bathroom and a small porch with hammock &amp; seats overlooking the pool. The bedroom has a comfortable king size bed and a flat screen TV. Air-conditioning is provided to ensure your comfort during hot days, and of course, you\'ll enjoy free WiFi.</p>\",\"photos\":[{\"name\":\"c8ea7aab6c9f2a0d05b69f3606c95e6b.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"8b77ba93560787878f50280d6fb52c5b.jpeg\",\"type\":\"image/jpeg\"}]}]','[{\"name\":\"NETTA ALESSANDRA\",\"email\":\"netta@mail.com\",\"is_yoga_alliance\":false,\"about\":\"<p>Meet Netta, our passionate personal trainer with a deep commitment to holistic health. Having explored diverse sports throughout her life, including competitive bodybuilding, she learned the transformative power of balanced training, nutrition, and mindset.</p>\",\"photos\":[{\"name\":\"34f7cf92adaa16dcdd8ebb8b256a94b4.jpeg\",\"type\":\"image/jpeg\"}],\"location\":{\"country\":\"US\",\"street\":\"624 Skyrim Ave, Las Vegas, Nevada, zip 65876\",\"buildingName\":\"\",\"city\":\"Salt Lake City\",\"state\":\"UT\",\"zipCode\":\"\",\"zipcode\":\"65876\"}},{\"name\":\"ANN THONGTOD\",\"email\":\"ann@mail.com\",\"is_yoga_alliance\":false,\"about\":\"<p>Ann Thongtod comes from the countryside of Thailand but is now a famous personality on the island, teaching yoga in private villas, 5-star resorts and, since 2016, at our cozy retreat.</p><p>She\'s very experienced and has a calm personality, with a voice and smile that will soothe even the busiest of minds.</p>\",\"photos\":[{\"name\":\"c5ce7426732458a67b1399ba148f4bd1.jpeg\",\"type\":\"image/jpeg\"}],\"location\":{\"country\":\"US\",\"street\":\"624 Skyrim Ave, Las Vegas, Nevada, zip 65876\",\"buildingName\":\"\",\"city\":\"Salt Lake City\",\"state\":\"UT\",\"zipCode\":\"\",\"zipcode\":\"65876\"}},{\"name\":\"LANDER\",\"email\":\"lander@mail.com\",\"is_yoga_alliance\":false,\"about\":\"<p>As a former tourist guide in Thailand, Myanmar, South Africa, and Borneo, Lander will take you deep into the jungle during the morning hikes and show you a different side of Koh Samui.</p><p>Typically he\'s working in the background, ensuring the smooth operations of the retreat.</p>\",\"photos\":[{\"name\":\"46836d9d51ac85b0d4b610eb08eaa578.jpeg\",\"type\":\"image/jpeg\"}],\"location\":{\"country\":\"US\",\"street\":\"624 Skyrim Ave, Las Vegas, Nevada, zip 65876\",\"buildingName\":\"\",\"city\":\"Salt Lake City\",\"state\":\"UT\",\"zipCode\":\"\",\"zipcode\":\"65876\"}}]','Retreat','6','15 Day All-inclusive Weight Loss & Wellness Retreat, Koh Samui','Koh Samui, Ko Samui District, Surat Thani, Thailand','TH',NULL,'Ko Samui District','2024-02-15 13:55:51','2024-02-15 13:55:51',1,NULL,'9.5214157','100.0482144','[221,219,218,225,223]','<p>Achieve your wildest fitness goals with us, while having loads of fun under the sun on Koh Samui, one of the most beautiful islands of Thailand.</p><p>Immerse yourself in our unique Natural Detox program, designed to deliver a comprehensive wellness experience:</p><ul><li>Cultivate mental serenity through yoga sessions</li><li>Sculpt your body &amp; discover your strength with tailored fitness classes and cardio sessions</li><li>Indulge in restorative massages for profound healing</li><li>Savor wholesome superfoods promoting longevity</li><li>Replenish with nutrient-rich juices and smoothies</li><li>Soak in the tropical sun for an infusion of joy and positivity</li></ul><p><br></p>','[240,261,270,246,282,307,313,315]',NULL,'<p>Welcome to our warm and inviting holistic fitness resort, where we take pride in providing a personalized and natural approach to detoxifying the body and achieving weight loss. Our unique blend of superfoods, invigorating cardio activities in nature, restorative yoga, and targeted strength training sets us apart.</p><p>Recognizing that everyone possesses unique fitness levels, yoga flexibility, and individual goals, our mission, passion, and joy lie in guiding you towards achieving them. Age is no barrier here, but we do encourage a basic fitness level to ensure a fulfilling and effective wellness experience.</p>','<p>Step into our intimate retreat, where we embrace a holistic and personalized approach to health and fitness, steering clear of quick-fix diets and extreme fasts. Our philosophy revolves around harnessing your body\'s innate ability to cleanse itself naturally through a harmonious blend of whole foods, nutritious smoothies, the nourishing sun, invigorating yoga, and purposeful exercise.</p><p>Our dedicated team is committed to harmonizing your mind, body, and spirit. We ensure your body receives the healthiest fuel, a daily dose of toxin-releasing exercise, replenishing smoothies &amp; juices, all complemented by yoga sessions and a serene pool for your relaxation and rejuvenation at your own pace.</p><p>The program is designed for a complete body reset, featuring yoga and fitness classes suitable for all levels. As you immerse yourself in this experience, you\'ll emerge feeling recharged, balanced, and equipped with newfound fitness and nutrition insights that seamlessly integrate into your daily life.</p><p>Join our vibrant community in the laid-back Wild Tribe Café, where the atmosphere is consistently relaxed and open-air. Our proven program has garnered remarkable results for our guests, their families, and friends, solidifying our position as one of Thailand\'s top health resorts. What sets us apart is our commitment to delivering this transformative experience without the hefty price tag associated with luxury resorts. Take the first step towards prioritizing your health and wellbeing by booking with us today!</p>','[325,326,327]',NULL,NULL,NULL,3,1,1,NULL,'yes','no',NULL,NULL,'<p>Located on the enchanting island of Koh Samui, Thailand, our sanctuary offers a perfect escape from the hustle and bustle of everyday life. The sun-kissed tropical climate lends itself to a heightened sense of well-being, while the pristine Lamai beach, just steps away, provides an idyllic backdrop for both relaxation and invigorating workouts.</p><p>Nestled in this serene paradise, you\'ll discover the harmonious blend of tranquility and vitality. Whether you seek the sandy shores or the lush jungle trails, everything is conveniently within walking distance. No need for motorbikes, cars, or taxis.</p><p>Adjacent to our resort, you\'ll find a Muay Thai School and an array of restaurants, bars, shops, and vibrant nightlife are just a stone\'s throw away.</p>',NULL,'[\"A/C in Rooms\",\"Bicycles For Rent\",\"Free Wifi\",\"Free Parking\",\"Garden\",\"Library\",\"Pool\",\"Restaurant\"]','<p>Experience Thailand\'s tropical climate, characterized by high temperatures and humidity, with an average of around 28℃ (80℉), creating a generally pleasant atmosphere. When the heat becomes intense, a refreshing dip in the pool or an invigorating ice bath awaits to aid in recovery.</p><p>Staying well-hydrated is crucial in this year-round \'summer temperatures\' setting. Although Koh Samui typically observes three traditional seasons:</p><ul><li>Dry season:&nbsp;January to April</li><li>Hot season:&nbsp;April to October</li><li>Wet season:&nbsp;November</li></ul><p>Climate change has introduced unpredictability, often blending sunny spells with brief rain showers, creating a unique daily rhythm. So, whether it\'s a radiant day or a passing shower, be prepared for the delightful unpredictability of Koh Samui\'s weather!</p>',NULL,NULL,'[29,33,41]','203','[162,166,161]','[136,134,142,140]','[173,174,175]','[343,350,353,352,345,357,341]',3,'<p>Awaken to the early morning sun as we embark on a cardio adventure through the breathtaking tropical landscapes of Koh Samui. From invigorating hikes and refreshing swims to cycling and the art of Muay Thai Boxing, your morning is a celebration of movement and vitality.</p><p>As the day unfolds, immerse yourself in a post-exercise ice-bath, a restorative ritual known for muscle recovery and mood enhancement. Offered weekly, this refreshing experience is coupled with a rejuvenating breathwork session.</p><p>Following a hearty breakfast, the open-air yoga studio beckons with daily sessions ranging from Yin and Vinyasa to Hatha and Qi Gong. Afterward, relish in a leisurely lunch and indulge in the customary siesta.</p><p>The afternoon unveils a world of possibilities—whether it\'s soaking in the sun on the beach, lounging by the pool, exploring the village, or visiting the local Buddhist temple.</p><p>As the clock approaches 4 or 5 pm, join our Strength &amp; Conditioning class, expertly designed to foster muscle growth, strength, and body toning. Led by qualified trainers versed in various styles, including HIIT, Weight Training, and Bodyweight Training, this engaging workout builds an appetite for our delectable dinner.</p><p>Evenings at our \"Wild Tribe Superfood Café\" offer a communal haven—sink into bean bags, engage in board games, delve into our mini library, or simply enjoy fast WiFi. Consider unwinding with a deep tissue massage before bedtime, a perfect prelude to a restful night.</p><p>Sundays are designated for well-deserved recovery, providing an opportunity to explore the captivating beauty of Samui at your leisure. Your holistic retreat is a harmonious blend of exhilarating activities, relaxation, and exploration.</p>',NULL,'จ.สุราษฎร์ธานี','[\"2024-03-03:2024-03-22\"]','<p>Fly to&nbsp;Koh Samui International Airport, where our driver will pick you up, and after 30 minutes you will arrive at the resort.</p><p>If you arrive by ferry, the trip from the pier to the resort is about the same in length.</p><p>You can fly to Koh Samui International Airport directly from all major Asian cities by the \'boutique airline\' Bangkok Airways.</p>',1,NULL,0),
(37,130,'[{\"type\":\"76\",\"price\":\"231\",\"seasonal_pricing\":[],\"deposit_percent\":\"15\",\"description\":\"<p>The single bed, budget accommodation offers guests a tranquil, rejuvenating, home away from home experience at an affordable price.</p><p>The room has a shared bathroom accessible outside of the room and a terrace overlooking the jungle. You also get free access to Wifi network.</p><p>The bedroom has a fan and a sink with mirror (no AC).</p>\",\"photos\":[{\"name\":\"dde64d89427a39e7a744d8a818fdb502.jpeg\",\"type\":\"image/jpeg\"}]},{\"type\":\"Shared\",\"price\":\"279\",\"seasonal_pricing\":[],\"deposit_percent\":\"15\",\"description\":\"<p>The single bed, budget accommodation offers guests a tranquil, rejuvenating, home away from home experience at an affordable price.</p><p>The room has a private bathroomin the room and a terrace. You also get free access to Wifi network. The bedroom has a fan (no AC).</p>\",\"photos\":[{\"name\":\"6dfb4c8cac4986e717110a0a2adb8dd4.jpeg\",\"type\":\"image/jpeg\"}]},{\"type\":\"113\",\"price\":\"597\",\"seasonal_pricing\":[],\"deposit_percent\":\"15\",\"description\":\"<p>The double bed accommodation offers guests a tranquil, rejuvenating, home away from home experience.</p><p>The room has its own bathroom and a terrace overlooking the jungle. You also get free access to Wifi network. The bedroom has a spacious and comfortable double bed.</p><p>Air-conditioning is provided to ensure your comfort during hot days.&nbsp;&nbsp;</p>\",\"photos\":[{\"name\":\"dd918b96cbdc47b693253031edc57f62.jpeg\",\"type\":\"image/jpeg\"}]}]','[{\"name\":\"I WAYAN SUWITRA\",\"email\":\"way@gmail.com\",\"is_yoga_alliance\":false,\"about\":\"<p>Since Wayan committed his life to yoga, he’s been studying it with Balinese and European masters who opened his heart, and mind, awareness for deeper understanding.&nbsp;</p><p>He experiences yoga as a meditative, healing and holistically balancing practice.</p><p>Wayan is certified with 200h TTC at School of Sacred Arts, Yoga for Happy, Cheerful and Healthy Kids TT, Fundamental Aerial Antigravity YT, Reiki and Love &amp; Kindness Healing Meditation.</p><p>His daily classes are held by Four Seasons Resort Ubud, Bali.</p><p>He shares his knowledge and experience with smile, kindness, and patience.</p>\",\"photos\":[{\"name\":\"3e934b2ee05570ecfc7af936c9dd4fdb.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"82de9e8e5c469a698517bb04ae611064.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"6bf0cbcf8432c4be898a79d58d670649.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"4aeeeeab71d3a38fc33724bb63ebcf2d.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"cbe3e7471043ca0273dbc71ab4895abc.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"a482e2c090b6984dc9ef91e480498478.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"1cf56a0d5c5442f9f025b65db2ea74a5.jpeg\",\"type\":\"image/jpeg\"}],\"location\":{\"country\":\"US\",\"street\":\"624 Skyrim Ave, Las Vegas, Nevada, zip 65876\",\"buildingName\":\"\",\"city\":\"Salt Lake City\",\"state\":\"UT\",\"zipCode\":\"\",\"zipcode\":\"65876\"}},{\"name\":\"MADHURI RASIKA DEVI DASI AKA PRADNYA\",\"email\":\"mad@gmail.com\",\"is_yoga_alliance\":false,\"about\":\"<p>Pradnya is an E-RYT 500 at Yoga Alliance. Has 100++ certification with Sivananda Ashram, Rishikesh India &amp; Yin yoga instructor certification (Bali Yoga Teacher). Since 2012 Pradnya is studying Bhuddhi Yoga &amp; Bhakti Yoga with Jani Jaatinen a.k.a. Mahayogi Gokulacandra Das. Pradnya is teaching Gokul Hatha and Gokul Vinyasa (Bahiranga and Antaranga Shadana)</p><p>During all these years of teaching, she had many opportunities to deepen her experiences as a professional yoga teacher by travelling all around the world. Together with Ary &amp; Kalina, she’s creating Gokul Yoga Bali school.</p><p>She is the founder and cocreator of Shanti Toya Ashram, a retreat centre for yoga and wellbeing.</p><p>Pradnya began her journey at the age of 6 when she began her lifelong study of classic Balinese dance. Her passion for dance then expanded to Modern Javanese, Balinese style as well as into Contemporary Western &amp; Latin dance. This eventually led Pradnya into Yoga &amp; since then she immersed herself into trainings throughout Bali and world.</p>\",\"photos\":[{\"name\":\"faafc52e7c91604bd138c86a6d1fea78.jpeg\",\"type\":\"image/jpeg\"}],\"location\":{\"country\":\"US\",\"street\":\"624 Skyrim Ave, Las Vegas, Nevada, zip 65876\",\"buildingName\":\"\",\"city\":\"Salt Lake City\",\"state\":\"UT\",\"zipCode\":\"\",\"zipcode\":\"65876\"}},{\"name\":\"KETUT ARYANTHA\",\"email\":\"ket@gmail.com\",\"is_yoga_alliance\":false,\"about\":\"<p>Ary was born into a Balinese healers family and practiced yoga from a young age with his yogi sister – Pradnya and father.</p><p>He graduated from the Tourism University, and 200 hour Yoga Teacher Training at the School of Sacred Arts in Ubud.</p><p>Together with Pradnya and Kalina, he is cocreating Gokul Yoga Bali school.</p><p>Ary teaches Gokul Hatha Yoga (Asana, Pranayama, Meditation) and Gokul Vinyasa Yoga.</p><p>His experience in teaching includes guiding community classes at Ubud Yoga Barn, weekly classes at Samadi Bali, and private classes.</p><p>Ary’s traditional approach to yoga makes people understand its roots and value.</p><p>He encourages people to establish their own practice by giving them the appropriate tools, wisdom, and skills. His sense of humor makes the experience light.</p>\",\"photos\":[{\"name\":\"d9de1800a161f46d2f306ae7fdbe0022.jpeg\",\"type\":\"image/jpeg\"}],\"location\":{\"country\":\"US\",\"street\":\"624 Skyrim Ave, Las Vegas, Nevada, zip 65876\",\"buildingName\":\"\",\"city\":\"Salt Lake City\",\"state\":\"UT\",\"zipCode\":\"\",\"zipcode\":\"65876\"}}]','Retreat','7','7 Day Serene Yoga and Wellness Retreat in Bali','Mengwi, Badung Regency, Bali, Indonesia','ID',NULL,'Mengwi','2024-02-16 05:12:02','2024-02-16 05:12:02',1,NULL,'-8.543465000000001','115.1715794','[220,217,221,219,223]','<p>Find the balance in your body and mind amid the serene setting in Bali.</p><p>You will have two daily yoga practices, relaxing afternoons to enjoy the ashram, and free time to join cultural classes or venture to other areas on the Island of the Gods, Bali.</p><p>The ashram is located only half an hour from the beach, giving you the chance to rejuvenate in the beautiful beaches of Bali.</p>',NULL,NULL,NULL,'<p>During this retreat, you will be staying at an Ashram. It offers an authentic taste of Bali, nestled in the quiet hillside of a lush jungle ravine and surrounded by the rice paddy farmlands of Penarungan village.</p><p>The property itself is the home of a peaceful gurgling river and an abundant holy spring water source with four villas (each with guest rooms and bathrooms) and two private villas.</p><p>There is also a beautiful second story thatched roof bamboo yoga shala, communal open-air dining hall, spring-fed swimming pool, and an organic vegetable garden.</p><p>There are plenty of nature walking opportunities just outside the ashram, through the quaint village and beautiful rice paddies.</p><p>As an additional activity, we offer a set of three yoga workshops which will help you establish your own yoga practice.</p><p>Practicing yoga in a class environment has great advantages. But having your own yoga practice, where you can build your strength and flexibility has even more advantages.</p><p>Join our workshops, if you want to know more about yoga, alignment of postures, and sequencing and if you want to come back home with your own practice of Hatha/Vinyasa yoga.</p><p>It will enable you to practice as often as you want and build your practice at your own pace.</p><p>They are priced at 45 USD each or all 3 of them for 135 USD.</p>','[325,326,327]',NULL,'EUR',NULL,3,1,1,'[]','yes','no',NULL,NULL,'<p>The retreat is located in Mengwi, in Bali, Indonesia.</p><p>It\'s approximately 25 minutes southwest of Ubud, a city-center highly regarded and sought after by yogis worldwide as the modern hub of the yoga community.</p>','[6,7]','[\"A/C in Rooms\",\"Art Room\",\"Bicycles For Rent\",\"Free Wifi\"]',NULL,NULL,NULL,'[75,76,78]','204','[166,165,168]','[134,135,136]','[173,174]','[343,344,342,340,341]',3,'<p>Here\'s your sample daily program. Please note: the program is flexible and you\'re free to take your time out if needed. This retreat is yours to enjoy!</p><p>Day 1: Sunday</p><ul><li>15:00 Arrival and settling in</li></ul><p>Day 2: Monday</p><ul><li>07:00 Morning flow Yoga</li><li>09:30 Balinese offering</li><li>15:00 Canang (Balinese offering) making class</li><li>17:00 Yin/Restorative Yoga</li></ul><p>Day 3: Tuesday</p><ul><li>07:00 Meditation</li><li>07:30 Morning flow Yoga</li><li>09:30 Balinese experience tour (visiting a traditional, Balinese house, Banrong dance, learning how to make coconut oil and plant rice paddies)</li><li>17:00 Dynamic Yoga</li></ul><p>Day 4: Wednesday</p>',NULL,'Bali','[\"2024-03-03:2024-03-20\"]','<p>The closest airport is&nbsp;Denpasar Ngurah Rai (DPR).</p><p>From there we offer a free pickup transport to the Ashram.</p>',1,NULL,0),
(38,131,'[{\"type\":\"76\",\"price\":\"510\",\"seasonal_pricing\":[],\"deposit_percent\":\"15\",\"description\":\"<p><strong>ChurchView Yurt Tent (Shared Twin)</strong></p><p><br></p><p>Our new cozy open stand-up Yurt Tent offers a peaceful immersion in nature with a Church View. Standing on a platform the Tent is furnished with rugged floors, Twin beds, a bedside table with a lamp, and storage drawers. The shared Bathroom is in the courtyard a 1-2 min walk from the tent.</p><p><strong>The price is for one individual sharing a Twin Tent. The beds can be pushed together to make a Superking on request. If you are two people who wish to share a tent, please book two spaces.</strong></p>\",\"photos\":[{\"name\":\"fb0299687507db4e5edfd31dc0c5be95.jpeg\",\"type\":\"image/jpeg\"}]},{\"type\":\"77\",\"price\":\"540\",\"seasonal_pricing\":[],\"deposit_percent\":\"5\",\"description\":\"<p>Our four-bed dorm has mountain village and Church views.</p><p>Each bed has its own independent charging point, light, shelves, and curtain with a large storage space under the bed, hanging hooks, and storage boxes.</p><p>The room has its very own antique Bulgarian Pechka wood burner, original wooden floor, and a shared clothes rail.</p><p><strong>The price is for one individual in a shared dorm.</strong></p>\",\"photos\":[{\"name\":\"fc737e291813ac233ecfc5b3de21cd36.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"6b97363c3c448d23375bedd79de839d3.jpeg\",\"type\":\"image/jpeg\"}]},{\"type\":\"76\",\"price\":\"610\",\"seasonal_pricing\":[],\"deposit_percent\":\"5\",\"description\":\"<h3><strong>Shared Room - FireFly Twin</strong></h3><p><br></p><p>Our twin room is furnished with a double wardrobe and side drawers with ample under-bed suitcase storage.</p><p>The room has its original wooden floor and a bespoke antique Bulgarian Pechka wood burner to keep it cozy.</p><p>This room has a double aspect with views over the courtyard and yoga barn and the mountain and village in the other direction.</p><p><strong>The price is for one individual in a shared room. Please book two spaces if you are two people who wish to share a room.</strong></p>\",\"photos\":[{\"name\":\"e4b7f6001c68303eb93e53f93fdf43bf.jpeg\",\"type\":\"image/jpeg\"}]},{\"type\":\"76\",\"price\":\"760\",\"seasonal_pricing\":[],\"deposit_percent\":\"3\",\"description\":\"<h3><strong>Private Single Occupancy - OldStable SuperKing</strong></h3><p><br></p><p>Our unique OldStable room is set under the Yoga Barn with stone and lime plaster walls; it has a traditional vibe and the Bulgarian rugged floor gives it the feel of a Mongolian yurt.</p><p>It has its own independent access and use of a courtyard bathroom with solar shower, dry compost WC and bottle windows directly next door</p><p>The room has a low ceiling and thick stone walls where it is partially built into the hill creating a refreshingly cool space in the hot summers.</p><p>Furnished with a Super King Size bed and oak furniture, if you like a quirky and private room this is the room for you.</p><p>This room is suitable for Digital Nomads and has a desk work space.</p><p>The price is for one individual in a Super King Size Bed.</p>\",\"photos\":[{\"name\":\"8964147013869b1afa54208e5462ef2d.jpeg\",\"type\":\"image/jpeg\"}]}]','[{\"name\":\"ROW\",\"email\":\"abc@gmail.com\",\"is_yoga_alliance\":false,\"about\":\"<p>Residents and community guests can enjoy the in-house classes and self-practice with the founder of the RisingSoul &amp; Retreat Space Rowena and the other community resident yoga coaches.</p><p>Rowena also has an Ayurvedic massage qualification and has 10 years of experience working with young people and adults who have suffered trauma and or addictions and harm within the home or family.</p><p>Individual Sessions can be arranged to support you with healing and self awareness.</p><p>Rowena’s Yoga Journey…</p><p>My first experiences of Yoga were through my mother who went to classes when we were children.</p><p>Aged 17 I was hit with the tragic loss of my father it was a very confusing and difficult time for me.</p><p>Aged 20 I traveled to Nepal to trek up the Himalayas for charity where I was exposed to the deeply spiritual nature of the Buddhist mountain people our Sherpa guides who taught us their self-practice of Thai Chi and through the experience presence and self awareness a sense that everything is just as it should be.</p><p>It was a life-changing experience and this allowed me to accept my father’s death in a way I had been unable to before.</p><p>It ignited a curiosity to find out more about the religious and spiritual practices of the East and their implications which I later studied.</p><p>Having suffered a serious horse riding accident 10 years later I found myself becoming a yoga student for entirely different reasons.</p><p>Following surgeries and courses of Western steroid injections to enable me to continue my career as a professional Equestrian Rider I was now practicing daily and using Yoga as a pain management system.</p><p>In 2017 I retired from competitive riding and began to consider what came next this led me to India where I was accepted on a scholarship to complete my Yoga Teacher Training and qualify to practice in Ayurvedic Massage.</p><p>I realized the depth of the teachings of Yoga and began to understand that this was not something that was practiced once a week in the village hall it is a way of life and a belief system with the potential to lead you to self-awareness and spiritual salvation</p><p>In 2019 I traveled to China for a work project during this time events in my personal life led me to reassess everything I knew and believed.</p><p>I began down a path of self-discovery and spiritual awareness building self-practices and listening to teachings that would enable me to begin to break down and dissolve ego and mind and my identification with pain in the body.</p><p>Having left China I travelled solo around Thailand and Cambodia and became acquainted with the teachings of Eckhart Tolle his work has inspired me and resonated with me in a way that has influenced me in all dimensions of my life.</p><p>During my time in Cambodia, I befriended a girl who initiated my journey across Cambodia to the town of Kep where I enrolled on a Yoga retreat which inspired me to create this project.</p><p>I have the greatest gratitude to all who have been part of my journey to date and I look forward to sharing my experiences and understanding of spiritual awareness with all that seek it at the RisingSoul Retreat.</p><p>This season you will be able to join up to try a variety of Yoga, Ariel, Poi and other theatrical based classes.</p><p>Show Less</p><p><br></p>\",\"photos\":[{\"name\":\"51964f778a06e161d0b9041f444ad821.jpeg\",\"type\":\"image/jpeg\"}],\"location\":{\"country\":\"US\",\"street\":\"624 Skyrim Ave, Las Vegas, Nevada, zip 65876\",\"buildingName\":\"\",\"city\":\"Salt Lake City\",\"state\":\"UT\",\"zipCode\":\"\",\"zipcode\":\"65876\"}},{\"name\":\"KALOYAN KANEV\",\"email\":\"kaloyan@gmail.com\",\"is_yoga_alliance\":false,\"about\":\"<p>My name is Kaloyan Kanev, I am 34 years old borne in Bulgaria and I have lived in London since 2013.</p><p>In 2014 shortly after started living with Ellie (Quantum Healing Hypnosis Therapist and PSYCH-K practitioner), my beloved fiancée, I started to uncover my passion for helping others regain their health.</p><p>She was the spark that ignited my insatiable desire for growth, and I wish everyone would find a partner like mine.</p><p>Back then Ellie shared that she had successfully reversed insulin-dependent type 2 diabetes solely through diet and about a peculiar kind of people called raw vegans.</p><p>It took us about year and a half to fully transition from normal omnivorish diet to a fully raw vegan lifestyle and during this period I learned a lot about food, nutrition, meditation and the human body.</p><p>Two years later around mid-2017, my attention was pointed to a man named Dr.Robert Morse and I started to adopt a fruitarian diet which I am following until the present day.</p><p>Today I am not as strict as In the beginning and I eat cooked food from time to time but I still call myself fruitarian because of the mindset.</p><p>If you are able to look with an unbiased mind you will discover that we, human beings are frugivores. I know this to be true because I have applied this lifestyle upon myself and others, and despite the trials and tribulations along the way it is worth it.</p><p>The things that I have done and I am proud of myself are many and I would like to point out some of them. In 2017 me and Ellie embarked on a soul journey, went into the jungles of Peru.</p><p>In 2018 instead of going on a holiday, I did my first 20-day water fast with a month-long preparation of grapes-only diet.</p><p>In 2019 and 2020 I did a 9 days dry fast inspired by a friend of mine and the work of Dr.Filinov. In 2020 I did 3 months of 10 degrees Celsius cold baths for 20 minutes every other day.</p><p>Throughout my journey I have tried to maintain open and unbiased mind and as a result I have acquired a piece of mind from many people such as : Drunvalo Melchizedeck, Vadim Zeland, Dan Mcdonald, John Collar, Dr. Rick and Carin DIna, Dr Collin Campbel, Dr Robert Morse, Gregg Braden, Bruce Lipton, Graham Hancock, Jared Tendler, Caroline Myss, Dolores Cannon, David Wilcock, Corey Goode, Aubrey Marcus, Sacha Stone, Elizabeth Wilcock, Tony Robins, Dorian Yates, Brian Rose, Wim Hof, Kevin Davies, Gerald O`Donnell, James Gililland and more.</p><p>Show Less</p><p><br></p>\",\"photos\":[{\"name\":\"d1805b672fefbc017a0eb72ca7e98e1e.jpeg\",\"type\":\"image/jpeg\"}],\"location\":{\"country\":\"DZ\",\"street\":\"624 Skyrim Ave, Las Vegas, Nevada, zip 65876\",\"buildingName\":\"\",\"city\":\"Salt Lake City\",\"state\":\"UT\",\"zipCode\":\"\",\"zipcode\":\"65876\"}}]','Retreat','4','10 Day RisingSoul Earth & Spirit Community Yoga Retreat, Bulgaria','Veliko Tarnovo, Bulgaria','BG','','Veliko Tarnovo','2024-02-16 05:44:53','2024-02-16 05:44:53',1,NULL,'43.0756739','25.6171514','[220,219,221,223,225,222]','<p><strong>Immersed in Nature, Support Our Sustainable Plant-Based Yoga Community﻿</strong></p><p><br></p><p>The RisingSoul was created to provide a safe space to reconnect with your authentic self and Mother Earth. An opportunity to find yourself immersed in the wild forest, mountain air, and spring water of Bulgaria\'s undiscovered gem, the Bohemian Balkans.</p><p>We are passionate about delivering a diverse, holistic, and welcoming Yoga Retreat which is a hub for social connection.</p><p>Situated on the Belitsa River, on the edge of the cultural and historic towns of Tryavna, and Veliko Tarnovo. We are surrounded by lush mountain valley forests, here you will find a vibrant international community of diverse and inspiring travelers and yoga coaches.</p><p>It is a magical place and we want you to enjoy and love this community as much as we do. We endeavor to live in harmony with the plants and animals that share their habitat with us and honor the spirits of the land and our higher selves.</p><p>We have manifested a noncommercial environment and remain passionate about reducing our eco-footprint and increasing sustainability, even though it requires acceptance, compassion, and compromise.</p><p>We are waiting to welcome you to the unique experience of living and breathing yogic practices, at the RisingSoul Community.</p><p>We invite you to embrace and disconnect from the material world regaining your barefoot connection to Earth and Spirit through the mediums of yoga, pranayama, and nature immersion.</p>','[240,261,269,256,274,277,281,265,276,271,268,266,264,259]','[247,248]','<p><strong>Connecting Earth &amp; Spirit In Nature﻿</strong></p><p><br></p><p>We invite you to join our bohemian rustic eco-conscious Karma Yoga Community in the stunning Balkan Mountains of Bulgaria. Are you ready to wake up to the sound of birds and spend your evenings stargazing or singing around the sacred fire?</p><p>If so welcome home, RisingSoul Retreat is a space to connect with other like minded beings whilst deepening your practice through collective spiritual, ceremonial, shamanic, meditative self-care, holistic, and yogic practices.</p><ul><li>This diverse retreat is ideal for those who wish to experiment with yoga asana styles, and meditation practices during their stay.</li><li>The retreat has a relaxed atmosphere with structure around daily practice and meals to keep things running smoothly</li><li>There are many opportunities for personal space and reflection time within the retreat community areas, and forest. Allowing you to process and spend time with yourself when needed.</li><li>Life here is deliberately basic, rustic and wonderful as we look inside instead of out</li><li>Guests receive support and encouragement from the combined personal journeys of our international resident coaches and volunteers, who share their diverse range of practices.</li><li>We also love to learn new things, and we ask that you come as you are, to be yourself, and bring and share your talents and skills with us!</li><li>As a guest, you will be invited to become part of the RisingSoul Community, get involved, and take part in all aspects of community living including Karma Yoga</li><li>Benefit from unrestricted access to the yoga barn and meditation room for self-practice, (when not in use for scheduled classes)</li><li>Multiple libraries, and various spaces indoors and out in nature to chill out, relax, self-reflect, and journal to support your healing journey.</li><li>Hidden silent waterfall right next to a meditation platform, a short walk away, inside the forest for moments of silence and reflection…</li></ul><p>At RisingSoul we believe that healing spaces should be available to everyone who is drawn and in need, and so we operate as a nonprofit collaboration, with our entire team devoting their time to Karma Yoga (the practice of selfless giving) without financial gain.</p><p>Please bring Bulgarian Les or Euro in cash, if you want to receive treatments. You can also support us by joining extra workshops, activities, or classes and by eating lunch in our village Chai House. All are sources of income for our volunteers and community.</p><p>We look forward to welcoming you as part of the RisingSoul Community. By joining us you are supporting our work and helping the project to grow and reach more and more people.</p>','<p>RisingSoul, created as a non-profit, is an eco &amp; eco-spiritually conscious community bringing vibrancy back to a forgotten village by providing a sustainable magical healing space and offering yoga retreats, for all those who are drawn here, regardless of race, faith, or financial status.</p><p>Immersed in the beauty of the Balkan mountains, our community embraces the simplicity and culture of village life and recognizes the benefits of a reduction in white noise and constant media exposure.</p><p>We invite you to experience how little we truly need and the lightness that this brings when we reconnect with each other &amp; the elements, as we let go of expectation and attachment to the material world.</p><p>We are especially conscious of providing a safe space, where solo travelers can feel at home, safe, respected, and comfortable. Therefore we do not accept instant bookings please contact us with your room and dates</p><p>We embody an encouraging yet flexible approach to our schedule where everyone is free to join classes, as they wish with the exception of karma yoga and our weekly sharing circle, which are essential practices creating connection, support, and unity among us.</p><p>Our venue is built from earthy organic material, bringing our guests a fusion of natural practice spaces, an outdoor summer kitchen, stone courtyard with an open-air chill-out zone, offering great views of the sunrise, ancient nearby churches, and mountain valleys.</p><p>Accommodation is provided in our historic, homely Bulgarian farmhouse and old stable room with en-suite, situated across the courtyard, next to the main house. There is also a forest glamping area, for those who want to connect more deeply to nature.</p><p>At RisingSoul, we are a Plant-based, substance-free community and abstain from meat, fish, and alcohol to enable detoxification and healing at a deeper level. To support our meditation practices, coffee is only available at the village Chai House between 12 pm and 4 pm.</p><p>We encourage awareness of personal struggles and recognize the importance of each individual healing journey.&nbsp;</p><p>At RisingSoul we believe that healing spaces should be available to everyone who is drawn and in need, and so we operate as a nonprofit collaboration, with our entire team devoting their time to Karma Yoga (the practice of selfless giving) without financial gain.</p><p>This act of service enables us to charge affordable prices so as many guests as possible can receive and heal here regardless of financial status. By joining us you are supporting our work and helping the project to grow and reach more and more people.</p><p>This includes taking part in karma yoga for 30 minutes, twice a day, which could include helping with cleaning and tidying up after meal times, taking care of the community garden that helps sustain us, walking the resident RisingSoul dogs, or feeding our resident cat, Princess Amira.</p><p>Please bring Bulgarian Les or Euro in cash, if you want to receive treatments. You can also support us, by joining extra workshops, activities, or classes and by eating lunch in our village Chai House.</p><p>All are sources of income for our volunteers and community. By joining us you are supporting our work and helping the project to grow and reach more and more people.</p><p>If you\'re still reading then we welcome you to join our community, disconnect from the material world, and regain connection to Earth and Spirit…Just get in touch with dates and room preferences to help us reduce admin.</p>','[325,327]','[332,333,338]','USD',NULL,15,1,1,'[]','yes','yes',NULL,'<ul><li>Welcome RisingSoul Natural Handmade Soap</li><li>Personal flights &amp; travel assistance with one of our BookRetreats travel experts</li><li>3 Day transformational online retreat ($200 value)</li><li>Exclusive BookRetreats curated playlists to set the mood for your self-practice</li></ul>','<p>The trains are slow and scenic but very affordable at just 6-10 euros if you are not in a rush this is a great option.</p><p>Please note on the BDZ train booking system Tryavna is spelt Trjavna you can get tickets at the station or even on the trains.</p><p>The Bulgarian Railways website is linked from our Find &amp; Connect - Travel Info page on the RisingSoul Retreat website.</p><p>Sofia - Trjavna: 07:00 - 12:57; 07:35 - 12:29; 10:10 - 15:52; 13:05 - 18:43; 13:22 - 18:19; 13:50 - 20:13; 16:45 - 21:41; 20:05 - 01:33; 22:45 - 06:27; 22:55 - 03:41 - obligatory train change, no direct ones!</p><p>Plovdiv - Trjavna: 04:55 - 09:20; 07:05 - 12:29; 10:09 - 15:24; 13:07 - 18:19; 16:20 - 20:13 (only this one is direct!); 16:45 - 21:41; 21:50 - 03:41;</p><p>Next to the bus station South/the railway station is “Hotel AM” - you can leave your luggage at their storage room for only 2lv and go for a walk around Plovdiv.</p><p>Varna - Trjavna: 04:55 - 09:43; 07:45 - 12:48; 09:05 - 15:21; 10:45 - 15:47; 13:55 - 18:45; 16:35 - 22:08; 21:55 - 06:33; 23:50 - 09:17 - obligatory train change, no direct ones!</p><p>Burgas - Trjavna: 05:35 - 09:20; 08:45 - 12:29; 14:45 - 18:19; 15:20 - 21:41; 22:50 - 03:41; 23:25 - 06:27 - obligatory train change, no direct ones!</p><p>We collect from Tryavna once a day from Tuesday to Thursday between 15.30 &amp; 17.00.</p><p>Three min walk from the train station the Hilez Hotel &amp; Adore Coffee Shop are located. If you want to explore the stunning old town of Tryavna google Clock Tower Tryavna, it is a 10-minute walk, you can leave your bags at the hotel if you buy a drink there.</p><p>Bulgarian Railways’ website is reliable, but bus stations\' websites are not, always try to call before and ask if there actually will be a bus.</p><p>Or contact the bus company directly, most of them have a website and they also sell online tickets (names of the companies are written in brackets).</p><ul><li>Sofia - Trjavna: 11.30-15.10 (Union Ivkoni)</li><li>Plovdiv (from bus station North) - Veliko Tarnovo: 8.30 - 12.30 (Plovdiv Express)</li><li>Varna - Veliko Tarnovo: 00:00; 07:30; 09:00; 11:30; 13:00; 16:30; 20:30; 22:00 (Biomet)</li><li>Burgas - Veliko Tarnovo: 07.30-11.20 (M-bus); 13.30 - 17.30 (Aleks OK)</li><li>Istanbul - Plovdiv (bus station South): 11:30 - 17:40; 22:30 - 06:25; 23:59 - 07:35 (Arda Tur). Scroll up to check how to get from Plovdiv to Trjavna/Veliko Tarnovo!</li></ul><p>Next to the bus station South/the railway station is “Hotel AM” - you can leave your luggage at their storage room for only 2lv and go for a walk around Plovdiv.</p><p>Buses from Istanbul are only from the bus station, not the airport!</p><ul><li>Thessaloniki - Sofia: 00:30 - 05:00; 08:00 - 13:00; 09:30 - 14:15; 15:30 - 20:25; 16.00 - 22.00. Scroll up to check how to get from Sofia to Trjavna/Veliko Tarnovo!</li><li>Bucharest - Ruse: 14:30 - 16:15; 16:15 - 18:00 (Pegasus) and then Ruse - Veliko Tarnovo: 09:30 - 11:50; 12:00 - 14:20 (double check) OR Bucharest - Varna: 14:30 - 19:00 (Pegasus) and then scroll up to check how to get from Varna to Trjavna/Veliko Tarnovo!</li></ul><p>We collect from Tryavna once a day from Tuesday to Thursday between 15.30 &amp; 17.00.</p><p>Next to the bus station and a three min walk from the train station is the Hilez Hotel &amp; Adore Coffee Shop, you can leave your bags at the hotel if you buy a drink there. Perfect if you want to explore the stunning old town of Tryavna. Just google Clock Tower &amp; Craft Street, Tryavna, it is a 10-minute walk,</p>','[3,4,5]','[\"Bar\",\"Wheelchair Accessible\",\"Library\",\"Security Guard\",\"Kitchen\",\"Housekeeping\"]','<p><strong>Springtime</strong>&nbsp;can be a combination of sunny warm days, cooler nights, and at times, spectacular thunderstorms.</p><p><strong>Summer</strong>&nbsp;is hot with occasional storms.</p><p><strong>Autumn</strong>&nbsp;is usually sunny by day and cold at night, normally dry.</p>',NULL,NULL,'[57,59,58]','210','[324,163,160,162,166,161]','[134,148,136,150,149,141,151,153,135,216]','[173,174,175]','[354,343,344,346,342,350,340,341]',30,'<p>The program has been designed to take you deeper into yourself through intense practices and detoxification of the body. We will guide you in your own bespoke journey, based on the information gained from your Metatron Scan.</p><p>The physical body is supported by Kundalini Kriyas to work on the emotional body that may be impacting your behavior patterns.</p><p>Gradually throughout the process, you will become increasingly self-responsible for your own self-care routine and will be trained to attend and start your classes unprompted and given the raw food skills to change your life.</p><p>We will challenge you so that you are fully equipped to thrive beyond this retreat.</p><p>Healing\'s a Matter of Time, But Also a Matter of Opportunity. Could This Be Yours?</p><p><strong>\"It is health that is the real wealth, and not pieces of gold and silver.” Mahatma Gandhi</strong></p><p>Schedule Guide:</p><ul><li>Morning Gong Noble Silence</li><li>Meditation</li><li>Herbal Tea &amp; Dream Journaling</li><li>Kundalini Yoga</li><li>Detox Shot &amp; Smoothies</li><li>Whole Fruit is available until 12.00</li><li>Raw Vegan salad bar (Chai House)</li><li>Educational session</li><li>Raw Vegan cooking workshops</li><li>Raw veggie fruit buffet &amp; fruit smoothy bowls for those that choose the deeper detox</li><li>Night practices</li><li><br></li></ul>','Flexible','Veliko Tarnovo Province','[\"2024-02-23:2024-03-14\"]','<p>TRANSFERS CAN NORMALLY BE ARRANGED BUT ARE QUITE EXPENSIVE STARTING AT 150 EUROS MOST OF OUR GUESTS TAKE THE DIRECT BUS OR TRAIN.</p><p>Book your flight to:</p><ul><li>Sofia Airport (SOF)</li><li>Plovdiv International Airport (PDV)</li><li>Varna Airport (VAR)</li><li>Burgas Airport (BOJ)</li><li>Istanbul Airport (IST)</li><li>Istanbul Sabiha Gökçen International Airport (SAW)</li><li>Thessaloniki Macedonia International Airport (SKG)</li><li>Henri Coandă International Airport (OTP)</li></ul><p>The cheapest airlines with regular flights are Wizzair, RyanAir, and EasyJet.</p>',1,NULL,0),
(39,132,'[{\"type\":\"77\",\"price\":\"2415\",\"seasonal_pricing\":[],\"deposit_percent\":\"15\",\"description\":\"<p>Retreat Specials for you!</p><p>*Shared King or Queen Room in a Beautiful Shared House on Kauai\'s North Shore~ Grab a friend, partner, or family member and take a king suite for yourselves. Shared bed/suite for two.</p><p>***Retreat taxes/fees (8%) are not included~</p><p>.</p><p>Enjoy a stay in a shared king or queen bed and share a room with your friend, partner, or family member!</p><p>We will be staying in a lovely house/s on the north shore in Princeville, where we will be within walking distance to walking paths, paths down to beaches, a park, and more. We\'ll be a 5-6 minute drive from the iconic town of Hanalei and the stunning Hanalei Bay and Beach where we will surf and hang by the pier where the waters and ocean is more calm and gentle.</p><p>We\'ll have greater space and a full kitchen to take advantage of so that we can also cook in as well as get out and about to several great local restaurants.</p><p>***Retreat taxes/fees (8%) are not included~</p>\",\"photos\":[{\"name\":\"adbd3895d1bf077d8618457f36193b50.jpeg\",\"type\":\"image/jpeg\"}]},{\"type\":\"Shared\",\"price\":\"2415\",\"seasonal_pricing\":[],\"deposit_percent\":\"15\",\"description\":\"<p>Retreat Specials for you!</p><p>*Shared Two Twin Room in a Beautiful Shared House on Kauai\'s North Shore~</p><p>***Retreat taxes/fees (8%) are not included~</p><p>.</p><p>Enjoy a stay in a shared twin room and share a room with a new friend on the retreat, or with your friend, partner, or family member!</p><p>We will be staying in a lovely house/s on the north shore in Princeville, where we will be within walking distance of walking paths, paths down to beaches, a park, and more. We\'ll be a 5-6 minute drive from the iconic town of Hanalei and the stunning Hanalei Bay and Beach where we will surf and hang by the pier where the waters and ocean is more calm and gentle. We\'ll have greater space and a full kitchen to take advantage of so that we can also cook in as well as get out and about to several great local restaurants.</p><p>***Retreat taxes/fees (8%) are not included~</p>\",\"photos\":[{\"name\":\"b0a99f757fda31a6166e7343f7919efe.jpeg\",\"type\":\"image/jpeg\"}]},{\"type\":\"77\",\"price\":\"2787\",\"seasonal_pricing\":[],\"deposit_percent\":\"15\",\"description\":\"<p>Retreat Specials for you~</p><p>*Private King or Queen Room in a Beautiful Shared House on Kauai\'s North Shore~</p><p>***Retreat taxes/fees (8%) are not included~</p><p>.</p><p>Enjoy a stay in a private king or queen bed in a shared retreat house~</p><p>We will be staying in a lovely house/s on the north shore in Princeville, where we will be within walking distance of walking paths, paths down to beaches, a park, and more. We\'ll be a 5-6 minute drive from the iconic town of Hanalei and the stunning Hanalei Bay and Beach where we will surf and hang by the pier where the waters and ocean is more calm and gentle.</p><p>We\'ll have greater space and a full kitchen to take advantage of so that we can also cook in as well as get out and about to several great local restaurants.</p><p>***Retreat taxes/fees (8%) are not included~</p>\",\"photos\":[{\"name\":\"af3b128635cb2c56b691599e4d288772.jpeg\",\"type\":\"image/jpeg\"}]}]','[{\"name\":\"MARY SUSAN STULTS\",\"email\":\"mary@mail.com\",\"is_yoga_alliance\":false,\"about\":\"<p>Been hanging out on the yoga mat since 1991.</p><p>My yoga and meditation practice and path began with my mother as a child at home in 1991 and continued in the studio at the age of 14 in 1997 with the practice of Ashtanga Yoga as taught by Sri. K Pattabhi Jois.</p><p>I practiced Hatha, Ashtanga Yoga, and Iyengar Yoga as taught by BKS Iyengar throughout high school and early college, and in 2002 began practicing at Richard Freeman and Mary Taylor\'s studio, the Yoga Workshop in Boulder, Colorado.</p><p>Years later I had the blessing and great fortune to be introduced and led to Master and Mentor-Teacher Maty Ezraty with whom I studied intensively, mentored, and assisted until her recent passing. Over thousands of hours and many years of study, mentoring, and practice, Maty influenced my practice and life on and off the yoga mat greatly and will forever be my greatest teacher and influence.</p><p>Over the years I have had the opportunity to practice and learn with many wonderful yoga and meditation teachers aside from Maty including Dharma Mittra, Judith Hanson Lasater, Richard Freeman, Seane Corn, Peter Doobinin, Carrie Owerko, James Brown, Jack Kornfield, and many others. I look forward to studying with Chuck Miller and Dona Holleman in the future.</p><p>I teach internationally and in the U.S and am a certified 500+HR E RYT Yoga &amp; Meditation teacher, educator, and practitioner, a WPA/Paddle Into Fitness Certified Stand Up Paddleboarding (SUP) and SUP Yoga teacher, certified Kids Yoga teacher, certified Adaptive Yoga teacher, and am known by all for my enthusiasm, heart, and positive outlook.</p><p>I teach a knowledgeable, dynamic, refreshing, and compassionate alignment-based yoga practice that intelligently weaves together the traditions of Iyengar Yoga and Ashtanga Yoga.</p><p>Many describe my energy as contagious, finding my nurturing, wise, soulful, &amp; patient style of teaching to be welcoming &amp; supportive to all. For me being a student of the practice of yoga is as important as being a teacher, we are students first, and teachers second.</p><p>I invite all students to let go of expectations, to be truly curious and compassionate, and to embrace and befriend an explorer\'s mindset within our own inner ecology.</p><p>I approach and understand yoga as a spiritual practice and discipline and healing art. We learn to trust our own intuition and innate wisdom, \\\"we do not learn to be intuitive, we already are.\\\"</p><p>The Yoga practice is a re-remembering and recognition of our wholeness and of the truth that we are always evolving, transforming, and are under constant construction; there is infinite room for learning, progression, and creative expression.</p>\",\"photos\":[{\"name\":\"1c3ad1341bb8988ab26706a4017c2040.jpeg\",\"type\":\"image/jpeg\"}],\"location\":{\"country\":\"US\",\"street\":\"624 Skyrim Ave, Las Vegas, Nevada, zip 65876\",\"buildingName\":\"\",\"city\":\"Salt Lake City\",\"state\":\"UT\",\"zipCode\":\"\",\"zipcode\":\"65876\"}}]','Retreat','6','8 Day Yoga, Meditation, Surf Adventure Retreat on Kaua\'i, Hawaii','Kauai, Hawaii, USA','US',NULL,'Kauai County','2024-02-16 17:39:41','2024-02-16 17:39:41',1,NULL,'21.9661076','-159.5737912','[217,218,220,226,224,221,222]','<p>Retreat to Hawaii with us here at home on the Garden Island of Kaua\'i!</p><p>Enjoy a New Year\'s Retreat Special just for you.</p><p>We hope to meet you on the yoga mat, on the beach, on the water, and on retreat in 2024.</p><p>.</p><p>A Hawaii Yoga, Meditation, Nature, and Surf Retreat and Adventure for all fellow yogis, travelers, adventurers, nature lovers, surfers, and students of life!</p><p>Together we\'ll enjoy a nourishing, enlivening, adventurous, and rejuvenating long week here in Hawaii on our home island of Kauai.</p><p>Join us as we find beauty, balance, and stillness amidst the flux and flow of life. Meet us in the land of rainbows where the ocean and soft sand beaches meet the towering green mountains and waterfalls.</p><p>Together we will enjoy a long island week on retreat as we create space to follow the tides and the island\'s natural rhythms.</p><p>Over the course of a long week, we\'ll ground in yoga practices and workshops, take time for guided meditations, get creative in a lei workshop and art workshop, and connect out in nature, in the ocean, on the beach, and on the waves.</p><p>We\'ll get out and about to explore the island\'s lesser-known gems and share our favorite spaces and places with an incredible group of fellow nature lovers, surfers, yogis, travelers, and adventurers.</p><p>Join us as we create space to take a deep and joyful dive into our yoga and meditation practices, and to life lived well on the garden island of Kaua\'i.</p><p>The week will include a well-balanced mix of plenty of practices, island exploration, free time to relax and explore on your own, and well-curated activities and island adventures.</p><p>There will also be the option to add and join an optional al la carte coastal boating adventure along the Napali coast or out to a different side of the island.</p><p>It\'s an epic and incredibly beautiful morning and afternoon on the water, and in for a snorkel and swim if conditions and weather allows. We head out with either Captain Andy\'s or Go Blue Adventures.</p>',NULL,NULL,'<p>An island retreat week for all! Come along and join us for 8 wonderful days shared on the picturesque, nature-laden, and majestic Garden Isle of Kauai, Hawaii.</p><p>Sharing retreats on my home island is such a joy and pleasure, and I can\'t wait to share a long and great week together. Our retreat week is an expansive, adventurous, joy-filled, and naturally luxurious week shared together on the lush and iconic North Shore of Kaua\'i in Princeville.</p><p>Together we\'ll enjoy a return to our true nature, and create space for a recognition and remembrance of our innate wholeness. We\'ll take time for practice, workshopping, island adventure and plenty of time out in nature, time to explore, and time to simply relax and be.</p><p>We\'ll embody and embrace that slower island pace of life, and the spaciousness and invitation to slow down as we follow the natural rhythms of the sun, the moon, and the tides.</p>','<p>IMMERSE, PRACTICE, EXPLORE</p><p>A Hawaii Yoga, Meditation, Nature, and Surf Retreat and Island Adventure.</p><p>Join us on the Garden Island of Kaua\'i for a truly incredible week of retreat together on the mat, on the beach, out in nature, and on the waves.</p><p>Located in the lush and exquisite North Shore of Kaua\'i nestled in Princeville, Kaua\'i-- The Garden Island of Kauai, Hawaii.</p><p>Join us as we find beauty, balance, and stillness amidst the flux and flow of life. Meet us in the land of rainbows where the ocean and soft sand beaches meet the towering green mountains and waterfalls.</p><p>Take a week just for yourself to deepen your yoga practice, explore, connect, enjoy a little island adventure and beauty, and take time for yourself.</p><p>Join me at home in Hawaii on the picturesque, nature-laden, and majestic Garden Isle of Kauai, Hawaii for an immersive, expansive, adventurous, joy-filled, and naturally luxurious week shared on the iconic North Shore.</p><p>Together we\'ll enjoy a return to and celebration of our True Nature and a recognition of our innate wholeness.</p><p>We\'ll create a sense of spaciousness to slow down as we follow the natural rhythms of the sun, the moon, and the tides.</p><p>Let\'s soak up and enjoy a deep dive into our yoga and vipassana meditation practices, plenty of surfing, the Hawaiian culture and history, Mother Nature and our earthly roots, art and creativity, Paddleboarding, and into life lived fully and well.</p><p>Take some time in paradise to progress your yoga practice, surf, and learn on the waves with an incredible local surf instructor, paddle, play, hike, explore, and enjoy that island life and plenty of beach days.</p><p>We\'ll enjoy a stay at a wonderful private home/s in Princeville, and enjoy the endless beauty surrounding us.</p><p>Retreat yourself this October in Hawaii and take time to explore the best beaches, get out into nature, venture to see other areas of the island, slow down and connect in a lei-making workshop, and enjoy time to enjoy our days to the fullest.</p><p>We believe that community is medicine, and together we thrive.</p><p>I can hardly wait to share all of the beauty of my home with you all on retreat this fall, xo</p><p>What’s Included</p><ul><li>7 Nights/ 8 Days shared lodging in Princeville, Hawaii (twin bed OR king/queen bed)</li><li>All Breakfasts</li><li>2 Dinners</li><li>Kauai Juice Co Green Juice + Wellness Shot Upon Arrival at</li><li>Welcome Circle</li><li>Daily Yoga Practices</li><li>Guided Meditation with Mary</li><li>2 Surf Lessons with a Local Instructor (we will follow the swell to wherever the waves are best)</li><li>Asana Workshops with Mary</li><li>Island Hike (weather dependent)</li><li>Island Exploration</li><li>Beach Time at the best beaches</li><li>Ocean/Beach Conservation Beach Cleanup + Net Patrol with</li><li>Kauai Surfrider + Mermaids at Work</li><li>Lei Making Workshop</li><li>Art Workshop/s (Painting)</li><li>Beach Bonfire with Fire Ceremony (weather dependent)</li><li>Transportation included within the retreat to adventures (not to and from the airport)(We will carpool in 1-2 cars to activities and adventures during the retreat)</li><li>Wifi</li><li>Retreat Gif</li></ul><p>What\'s Not Included</p><ul><li>Airfare</li><li>Travel to and from the retreat</li><li>Travel Insurance</li><li>Alcohol</li><li>5 Dinners</li><li>Lunches</li><li>Tips</li><li>Extra Activities</li><li>***Retreat taxes/fees (8%) are not included~</li></ul><p>Retreat Leader - Mary Susan Stults</p><p>Born in Fort Payne, Alabama, Mary Susan Stults was raised in Cedar City, Utah. After moving to Colorado in 2001 to attend CU Boulder, she made Colorado her mountain home for about 20 years until she followed her heart to Hawaii.</p><p>In 2018, she traded the mountain life for island life and moved to Kauai, Hawaii where she lives with her fiance Brandon, and their two cats, Tux and Sir Wobbles.</p><p>Mary Susan’s yoga and meditation practice and path began early in life with her mother as a child at home in 1991 and continued in the studio at the age of 14 in 1997 with the practice of Ashtanga Yoga. Mary practiced Hatha, Ashtanga Yoga, and Iyengar Yoga throughout high school and early college and in 2002 began practicing at Richard Freeman and Mary Taylor\'s studio, the Yoga Workshop in Boulder, Colorado. Years later, Mary had the blessing to find Master Mentor-Teacher Maty Ezraty with whom she studied intensively, mentored, and assisted until her recent passing in 2019. Over thousands of hours and many years of study and practice, Maty shaped and influenced Mary Susan’s practice, teaching, and life on and off the yoga mat.</p><p>Mary Susan teaches in the U.S and internationally and is an experienced Senior Yoga &amp; Meditation teacher, educator, mentor, and practitioner. She is a certified and experienced Yoga and Meditation teacher, educator, and practitioner, a WPA/Paddle Into Fitness Certified Stand Up Paddleboarding (SUP) and SUP Yoga teacher, certified Kids Yoga teacher, certified Adaptive Yoga teacher, and is known by all for her enthusiasm, heart, and positive outlook.</p><p>She teaches a knowledgeable, dynamic, and refreshing yoga practice that intelligently weaves together the traditions of Iyengar Yoga and Ashtanga Vinyasa Yoga. She also enjoys teaching Yin, Restorative Yoga, Therapeutic Yoga, Vipassana, and Mindful Meditation. Many describe her energy as contagious, finding her nurturing, wise, grounded, &amp; patient style of teaching to be welcoming &amp;supportive. Her offerings are infused with her grounded yet light-hearted nature. When she is not teaching herself you can often find her in a training or Yoga intensive with one of her teachers or mentors.</p><p>YOGA</p><p>We will be practicing a strong, dynamic, and compassionate yoga practice and flow marrying together the traditions of Iyengar and Ashtanga Vinyasa Yoga.</p><p>We will slowly and mindfully weave our way through alignment-based practices each day taking time to workshop asanas and come-see-come-look moments giving students the opportunity to demo postures as we practice.</p><p>Expect longer holds, break-downs of alignment and postures, and a focus on the breath. Classes are appropriate for all levels from beginners to advanced practitioners and teachers. We ask students to be curious and expect to take a deep and joyful dive into the practice and their inner ecology and wilderness.</p><p>Styles:&nbsp;Ashtanga Yoga, Hatha Yoga, Restorative Yoga, Vinyasa Yoga, Vipassana &amp; Yoga, Iyengar Yoga, Yin Yoga, General Yoga</p><p>Skill Level:&nbsp;Appropriate for beginner, intermediate, and advanced</p><p>MEDITATION</p><p>We will enjoy guided meditation and will explore the style of Vipassana meditation also known as insight meditation.</p><p>Within this style, we will explore a variety of methods including breath meditation, heart meditation compassion meditation, and a metta or loving-kindness meditation. We will talk about the basics of meditation, finding a comfortable seat, and the roots of mindfulness.</p><p>HIKING</p><p>We will be getting out for a hike or nature walk while on Kauai to further immerse in the lush vegetation and island flora and fauna surrounding us.</p><p>Please plan on some uphill and incline hiking as many of Kauai\'s hikes go up up up for those exquisite island views, as well as mud and hiking amidst Kauai\'s gorgeous red dirt. Kauai\'s red dirt stains so please plan accordingly and bring some clothing and hiking shoes you do not care about getting muddy or stained.</p><p>SURFING</p><p>We will be heading out for surfing lessons with a local instructor during our retreat and will also have some free time to surf more or add additional lessons. We will surf on the north shore most likely on Hanalei Bay, but swell dependent.</p><p>Hanalei Bay is one of the most well-known spots on the island of Kauai, and there are many other spots in and around the bay. Hanalei itself is a long right point that breaks on the eastern side of the bay for up to 300 yards over a lava reef.</p><p>It is a fairly powerful wave with occasional barrel sections that end with an inside bowl section in the middle of the bay. Farther north, up and around the point from Hanalei, is a reef break right called Hideaways. Further inside the bay is PineTrees, which needs a larger swell and a good sandbar setup at the river mouth. Directly across Hanalei Bay from the main point is a fickle left reef break called Waikokos, which needs a large N swell and W wind. The beloved pier offers friendly waves for all levels.</p><p>HAWAIIAN LEI MAKING</p><p>Immerse in the Hawaiian culture and learn the art and techniques of traditional lei making on the garden island of Kauai. Enjoy a lei-making workshop and immersive experience with Kaua\'i-born and raised Ivory Kealani Lloyd in a beautiful workshop-style floral adventure using local and native flowers and plants.</p><p>OPTIONAL BOATING ADVENTURE</p><p>Napali Coast Boat + Snorkel Adventure (weather dependent)</p><p>$250 + tax per person.</p><p>LOCATION -&nbsp;Princeville, Hawaii - North Shore</p><p>We will be staying in several beautiful private homes/condos for the retreat.</p><p>Located in the heart of Princeville within a mile of many activities such as tennis, bike/exercise paths, golfing, surfing, and snorkeling. Nearby beaches are SeaLodge, Pu\'u Poa, and Pali Ke Kua (Hideaways). There are restaurants and shops all within the Princeville Resort Community. Foodland Supermarket, a gas station, a post office, and banks are about a mile away at the Princeville Center located to the left of the entrance to Princeville.</p><p>The world-famous Hanalei Bay is just a few minutes drive. Hanalei town is home to unique and flavorful restaurants and food trucks, farmers market, shops, and beach equipment rental. Beyond that lies Tunnels Beach, Ke’e Beach, and the Hanakapai‘ai trailhead, to name a few jewels.</p><p>Traveling south you will find the newly opened Anaina Hou miniature golf course with a Hawaiian tropical theme. Kilauea Lighthouse, botanical gardens, zip lines, helicopter rides, and kayaking.</p><p>See you on the beach, xo</p>','[325,327,328]',NULL,'EUR',NULL,3,1,1,NULL,'yes','no',NULL,NULL,'<p>Kauai is Hawaii\'s fourth-largest island and this lush and beautiful is fittingly called the \"Garden Island.\"</p><p>The oldest and northernmost island in the Hawaiian chain is draped in emerald valleys, sharp mountain spires, and jagged cliffs aged by time and the elements.</p><p>Centuries of growth have formed tropical rainforests, forking rivers, and cascading waterfalls! Some parts of Kauai are only accessible by sea or air, revealing views beyond your imagination.</p><p>More than just dramatic beauty, the island is home to a variety of adventures, places to connect to the island\'s natural beauty, and endless outdoor activities. You can kayak the Wailua River, snorkel on Poipu Beach, hike the trails of Kokee State Park, or go ziplining above Kauai\'s lush valleys.</p><p>But, it is the island\'s laid-back atmosphere and rich culture found in its small towns that make it truly timeless. Explore the regions of Kauai and make your escape to discover the undeniable allure of the island.</p><p>For the retreat, we\'ll be surfing in Hanalei Bay which is one of the most well-known sports on the island of Kauai, and there are many other spots in and around the bay.</p><p>Hanalei itself is a long right point that breaks on the eastern side of the bay for up to 300 yards over a lava reef.</p><p>It is a fairly powerful wave with occasional barrel sections that end with an inside bowl section in the middle of the bay.</p><p>Farther north, up and around the point from Hanalei, is a reef break right called Hideaways. Further inside the bay is PineTrees, which needs a larger swell and a good sandbar set up at the river mouth.</p><p>Directly across Hanalei Bay from the main point is a fickle left reef break called Waikokos, which needs a large N swell and W wind. The beloved pier offers friendly waves for all levels.</p>',NULL,'[\"A/C in Rooms\",\"Bicycles For Rent\",\"Free Wifi\",\"Free Parking\",\"Kitchen\",\"Pool\"]',NULL,NULL,NULL,'[10,14,17]','204','[166,165,164,162]','[137,133,134,140,135,136,142,148]','[173,174,175]','[354,344,343,350,340,341]',8,'<p>Meet us in the islands of Hawaii for an incredible week on retreat, on the yoga mat, and on the waves.</p><p>Together we\'ll enjoy:</p><ul><li>daily yoga and meditation</li><li>2 surf lessons</li><li>guided adventure and activities</li><li>art and creativity (painting!)</li><li>beach days</li><li>hiking</li><li>island exploration</li><li>a lei making workshop</li><li>stand up paddle adventure on the river</li><li>a fire ceremony (weather dependent)</li><li>option to add a day boat adventure</li><li>and so much more!</li></ul><p><br></p>',NULL,'HI','[\"2024-03-03:2024-03-22\"]','<p>Please&nbsp;fly into&nbsp;Lihue Airport (LIH)&nbsp;on Kauai, Hawaii.</p><p>Upon arrival, students can take a taxi, uber, or rental car to the retreat locale on Kauai\'s iconic North Shore to our hotel in Princeville, Hawaii.</p>',1,NULL,0),
(41,134,'[{\"type\":\"Shared\",\"price\":\"835\",\"seasonal_pricing\":[],\"deposit_percent\":\"15\",\"description\":\"<p>The spacious, two-bedroom studio has a private entrance and all the amenities needed for a comfortable stay, including central heat and air, laundry, and free, fast WiFi. This charming, rustic space is fully equipped with a well-stocked kitchen, a full bathroom with a tub, and a private deck overlooking a canyon of wooded forest and spectacular sunset views.</p><p>The lodge has an acre garden with organic vegetables and fifteen mature fruit trees, along with a greenhouse full of medicinal herbs, all accessible to our guests. The lodge runs on delicious well water that can be drunk from any tap on the property. There is also a whole home generator for unexpected power outages, so stays throughout snowy winters are completely comfortable.</p><p>Our mountain retreat is in Sierra Springs, just a little over 3 miles from Sly Park Lake, an hour\'s drive to Lake Tahoe, and 25 minutes from the charming city of Placerville with an array of antique and gem shops and gourmet restaurants. We are also only one hour from Sacramento and two hours from the Bay Area.</p><p>The price is for one person&nbsp;and includes the entire two-bedroom guest suite. You may add up to five additional guests for only $499 per additional guest for full participation in all retreat activities.</p><p>**Please note, as we have multiple accommodation options available, our calendar will remain open until all of our accommodations are booked for a particular date. Please inquire first about the availability of a preferred accommodation.</p>\",\"photos\":[{\"name\":\"d2aa67789bc00c5501485006269b203c.jpeg\",\"type\":\"image/jpeg\"}]},{\"type\":\"Shared\",\"price\":\"742\",\"seasonal_pricing\":[],\"deposit_percent\":\"15\",\"description\":\"<p>This converted two-bedroom trailer has been revamped into a comfortable tiny home with two separate rooms, a full kitchen, and a dining/living room space. It includes a microwave, oven, a.c., an electric fireplace, and all the kitchen amenities needed for a comfortable stay.</p><p>The price is for one person&nbsp;and includes the entire two-bedroom tiny home. You may add up to three additional guests for only $299 per additional guest for full participation in all retreat activities.</p><p>**Please note, as we have multiple accommodation options available, our calendar will remain open until all of our accommodations are booked for a particular date. Please inquire first about the availability of a preferred accommodation.</p>\",\"photos\":[{\"name\":\"bc028a8dc5b35fd705c0d25a737a0513.jpeg\",\"type\":\"image/jpeg\"}]},{\"type\":\"Other\",\"price\":\"649\",\"seasonal_pricing\":[],\"deposit_percent\":\"15\",\"description\":\"<p>Have you always wanted to sleep up in the treetops under the dark velvet sky?</p><p>This treehouse dome (about 8 feet off the ground) is a cozy, rustic option for those who want to be out in the middle of nature with only the sound of the birds to wake up to each morning. The bed is a firm queen mattress and takes up the entirity of the dome. It is equipped with lanterns and a little deck to enjoy for meals or meditation.</p><p>There is an outdoor bathroom with a compostable toilet, sink and hot shower. The meals will be offered at the main lodge, a short walking distance uphill.</p><p>You may add up to one additional guest for only $299 per additional guest for full participation in all retreat activities.</p><p>**Please note, as we have multiple accommodation options available, our calendar will remain open until all of our accomodations are booked for a particular date. Please inquire first for the availability of a preferred accomodation.</p>\",\"photos\":[{\"name\":\"81a9b0610426c0667fd0db0097537485.jpeg\",\"type\":\"image/jpeg\"}]}]','[{\"name\":\"DR. SANDEROVSKY\",\"email\":\"sand@gmail.com\",\"is_yoga_alliance\":false,\"about\":\"<p>Dr. Sanderovsky is a professor of global philosophy, religion, and psychology. She also holds a credential in Integral Therapies and Medicine.</p><p>She teaches and designs courses at many colleges and universities, including her most popular classes on Death and Dying and World Religions.</p><p>She is a grief and trauma educator and a somatic practitioner with a non-dual emphasis. She has spent much of her adult life living in Southeast Asia and West Africa, studying a range of healing modalities, including yoga and energy medicine in India and Cambodia and sound healing in Nepal, Senegal, and Mali.</p><p>She is the author of several publications on global spiritual beliefs, practices, and rituals, with works featured in ‎iUniverse, Lonely Planet, and National Geographic.</p>\",\"photos\":[{\"name\":\"daf7f3ce4c007ecb6179f09f6ae70bfe.jpeg\",\"type\":\"image/jpeg\"}],\"location\":{\"country\":\"US\",\"street\":\"624 Skyrim Ave, Las Vegas, Nevada, zip 65876\",\"buildingName\":\"\",\"city\":\"Salt Lake City\",\"state\":\"UT\",\"zipCode\":\"\",\"zipcode\":\"65876\"}},{\"name\":\"JACK SHANK\",\"email\":\"jack@mail.com\",\"is_yoga_alliance\":false,\"about\":\"<p>Jack is a gifted healer, intuitive, and Reiki master who brings authenticity and passion to his work. Guests are often inspired by his grounded presence and nurturing spirit.</p>\",\"photos\":[{\"name\":\"5089690281f08589421fe7524cf0fbd2.jpeg\",\"type\":\"image/jpeg\"}],\"location\":{\"country\":\"US\",\"street\":\"624 Skyrim Ave, Las Vegas, Nevada, zip 65876\",\"buildingName\":\"\",\"city\":\"Salt Lake City\",\"state\":\"UT\",\"zipCode\":\"\",\"zipcode\":\"65876\"}}]','Retreat','2','3 Day Reiki Certification Retreat: Signs, Symbols & Dreams, CA,US','Pollock Pines, CA 95726, USA','US',NULL,'Pollock Pines','2024-02-16 17:59:06','2024-02-16 17:59:06',1,'95726','38.7612923','-120.5865935','[226,217,218,225]','<p>Located in the Sierra Nevada mountains, an hour outside of Lake Tahoe, this one-of-a-kind retreat offers you the opportunity to dive deep into the powerful life-force energy of Reiki.</p><p>The founder of Reiki, Dr. Usui Sensei, received Reiki from Mount Kurama in Japan, so it is fitting that we explore the power of Reiki in the middle of a sacred, mountain forest, with the sounds of nature at the forefront.</p><p>Nestled on twenty lush acres, our eco-lodge, healing sanctuary offers a range of therapeutic venues to enjoy while you receive your training and certification in Reiki I and II. Mastery level is also available for those who have previously completed levels I and II.</p><p>In our pre-session call, we will tailor your retreat schedule, according to your needs.</p>',NULL,NULL,'<p>Having trained in many forms of energy healing in the U.S., Asia and Africa, Dr. Sanderovsky brings a unique perspective in her approach to the healing arts, contextualizing each practice within the larger spectrum of holistic methods across the globe.</p><p>There will be opportunities for additional personal grounding and rejuvenation to bring your most centered self to the Reiki training. From the Himalayan salt cave to restore your sense of relaxation, to the sensory deprivation float tank, we offer many opportunities for coming back home to yourself. In addition, our yoga greenhouse dome provides a regenerative sanctuary for daily use.</p><p>The 40-foot crystal labyrinth invites you to a unique journey inward. The one-of-a-kind somatic space room, high-end massage chair, and crystal light bed offer a cosmic adventure, complementing the earthiness of the surrounding natural beauty.</p><p>Come as a solo traveler, with a friend or partner, or bring the whole family. We tailor our programs for all ages.</p>','<p>Once considered a fringe healing modality, Reiki is now a well-researched healing modality that has infiltrated the mainstream, actively practiced in over 1000 hospitals throughout the country. Whether you are a health care practitioner, therapist, or healer, or just want to offer this amazing treatment to yourself and others, our 3-day all-inclusive retreat will offer you the opportunity to dive deep into the techniques, practice, and high-frequency experience of Usui Reiki I and II.</p><p>In this workshop, students will receive Reiki I and II, integrating meditation and grounding techniques, surveying a history of Reiki and its relation to other healing arts, and facilitating hands-on practice, chakra balancing, and attunements. We will explore universal signs, symbols, and dreams, in a larger context.</p><p>This retreat is all-inclusive, year-round, and offers opportunities for extensions and additional packages.</p><p>Please note: This is a private retreat, however, there may be other guests staying in additional lodgings for other retreats. The classes, activities, etc, will all be on a private basis, though, there will be interactive opportunities for Reiki practice. You may also opt to have your meals with other guests.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'yes','no',NULL,NULL,'<p>We are located in Sierra Springs, just a little over 3 miles from Sly Park Lake. There are opportunities to hike around the property and visit the many amenities on site.</p><p>This wellness space is truly one of a kind and offers something for just about everyone.</p><p>The spectacular sunsets, along with the plentiful wildlife, including regular visits from deer, rabbits, turkeys, and a plethora of singing birds, make this a nature lover\'s paradise.</p>',NULL,'[\"A/C in Rooms\",\"Free Wifi\",\"Free Parking\",\"Garden\",\"Heating\",\"Kitchen\",\"Laundry\",\"Sauna\",\"Spa\"]',NULL,NULL,NULL,'[51,53,29,34,37]','207','[166,165,168,161]','[133]','[173,174,175]','[354,344,352,343,342,350,340,341]',NULL,'<p>The schedule will be set prior to the retreat with an initial phone consultation. We aim to accommodate the diversity of sleep cycles, optimal energy times and desired downtime with each individual. The general guideline is as follows:</p><p>Day 1:&nbsp;Guests are invited to arrive by early afternoon so they can settle in and explore the grounds.</p><ul><li>Check-in and explore the grounds</li><li>Late afternoon meditation</li><li>First Reiki training class</li></ul><p>Day 2:</p><ul><li>Morning meditation &amp; yoga class</li><li>Morning Reiki training &amp; practice</li><li>Mid-afternoon Reiki training &amp; practice</li><li>Evening meditation Reiki training &amp; practice</li></ul><p>Day 3:</p><ul><li>Morning meditation &amp; Reiki practice</li><li>Closing ritual</li></ul><p>Please note: This is a private retreat, however, there may be other guests staying in additional lodgings for other retreats. The classes, activities, etc, will all be on a private basis, though, there will be interactive opportunities for Reiki practice. You may also opt to have your meals with other guests.</p><p>Even though room check-out is at noon on Day 3, you have the opportunity to use the amenities for the remainder of the day.</p>',NULL,'CA',NULL,'<p>Book your flight to&nbsp;Sacramento International Airport (SMF).</p><p>We are just over an hour\'s drive from SMF airport.</p><p>Uber averages about $95 each way. If you feel uncomfortable taking Uber, we can pick you up and drop you.</p>',1,NULL,0),
(42,138,'[{\"type\":\"77\",\"price\":\"363\",\"seasonal_pricing\":[],\"deposit_percent\":\"15\",\"description\":\"<p>Bunk bed in a dorm room that can accommodate up to 6 people with shared bathrooms in the hallway. This is a female only dorm</p>\",\"photos\":[{\"name\":\"c1d7db83cc9386bfcb8fbf607d55adf4.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"948300b3aa19c7d47798583ea5bd0eed.jpeg\",\"type\":\"image/jpeg\"}]},{\"type\":\"77\",\"price\":\"363\",\"seasonal_pricing\":[],\"deposit_percent\":\"15\",\"description\":\"<p>Bunk bed in a dorm room that can accommodate up to 6 people with shared bathrooms in the hallway. This is a male only dorm.</p>\",\"photos\":[{\"name\":\"7a363c1c2610a0e6bd9f6a01fb6884ae.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"35260fa59c9a23e8a39dac9170310bfb.jpeg\",\"type\":\"image/jpeg\"}]}]','[{\"name\":\"DADA RAINJITANANDA\",\"email\":\"dada@email.com\",\"is_yoga_alliance\":false,\"about\":\"<p>Dada Rainjitananda Avt, an Acarya (spiritual teacher) since 1984, is a yoga instructor (E-RYT500) affiliated with Yoga Alliance, USA. His journey as an acarya began in Africa, leading him across Europe from 1986 to 2000, imparting knowledge on yoga &amp; meditation.</p>\",\"photos\":[{\"name\":\"d7b9a6b31421d9ac27d976cf1a2e58d0.jpeg\",\"type\":\"image/jpeg\"}],\"location\":{\"country\":\"\",\"street\":\"test\",\"buildingName\":\"test\",\"city\":\"123\",\"state\":\"123\",\"zipCode\":\"\",\"zipcode\":\"123\"}}]','Retreat',NULL,'3 Day Meditation, Yoga & Living with Purpose Retreat in NY, USA','Purling, NY 12470, USA','US','','Purling','2024-03-17 11:52:23','2024-03-17 11:52:23',1,'12470','42.2840699','-74.0201416','[219,222,221,223]','<p>Discover the life-changing potential of yoga and meditation in just three unforgettable days. Picture a serene morning, as you begin each day with a tranquil meditation and invigorating yoga session from the comfort of your own home. Feel the profound impact as you effortlessly stay focused on what truly matters to you – the meaningful work you were destined for. Now, imagine experiencing this blissful routine day after day.</p><p>Prepare to embark on an incredible journey at our upcoming weekend retreat, where we invite you to immerse yourself in the transformative practices of meditation, yoga, and purposeful living.</p>','[261,263,269,246,307]',NULL,'<ul><li>2 workshops to learn about \"The Essence of Meditation, The Essence of Yoga, and The Essence of Living with Purpose\"</li><li>6 collective meditation sessions for a deep, blissful meditation experience that takes you way beyond stress management</li><li>3 top quality yoga classes</li><li>6 vegetarian meals</li><li>Deep conversations with like-minded people and fun</li><li>A stunningly beautiful environment</li><li>2 nights accommodation</li></ul><p><br></p>','<p>Our Meditation, Yoga &amp; Living with Purpose Retreat is designed to help you learn about the essence of meditation and yoga and to experience the profound benefits of both practices in a stunningly beautiful setting. The goal of this weekend is to provide you with the knowledge and skills you need to develop a sustainable meditation and yoga practice that you can incorporate into your daily life.</p><p>Workshops:</p><p>This is a series of retreats and each time the two workshops will cover topics concerning the Essence of Meditation, the Essence of Yoga, and The Essence of Living with Purpose.</p><p>Collective Meditation Sessions:</p><p>The six collective meditation sessions will be led by experienced meditation teachers. The sessions will be designed to help you deepen your meditation practice and experience a deep, blissful state of meditation. You will learn a basic technique of mantra meditation that you can do every day at home.</p><p>Yoga Classes:</p><p>The three yoga classes will be led by experienced yoga teachers. The classes will be designed to help you improve your flexibility, strength, and balance. The classes will also be designed to help you experience the mind-body connection and develop a deeper understanding of yoga philosophy.</p><p>Vegetarian Meals:</p><p>You will be provided with six vegetarian meals during your retreat. The meals will be prepared with fresh, local ingredients and will be designed to nourish your body and mind.</p><p>Deep Conversations and Fun:</p><p>The retreat will also provide opportunities for you to have deep conversations with like-minded people and to have fun. There will be time for socializing, exploring the surrounding area, and relaxing.</p><p>Stunningly Beautiful Environment:</p><p>The retreat will be held in a stunningly beautiful environment. You will be surrounded by nature and will have the opportunity to enjoy the peace and tranquility of the setting.</p><p>Accommodation:</p><p>You will be provided with 2-nights of accommodation in a comfortable and inviting setting.</p>','[325,326,327,328]',NULL,'USD',NULL,5,1,1,'[]','yes','no',NULL,NULL,'<p>Nestled amidst a picturesque and serene landscape of the Catskills, Upstate New York, the retreat center is a hidden gem waiting to be discovered. Situated in a tranquil setting, surrounded by lush woods, pristine wetlands, open fields, and enchanting walking trails, it offers an idyllic backdrop for your transformative journey.</p><p>As you walk around, the beauty of nature envelops you, providing a sense of calm and serenity.</p>',NULL,NULL,'<p>Our retreat center is located in a four-season climate. Please pack accordingly, bringing clothes suitable for cold winters, moderate summers, colorful fall, and rainy spring.</p><p>Cairo, New York, experiences a humid continental climate with hot summers and cold winters. The average high temperature in July is 82 degrees Fahrenheit (28 degrees Celsius), and the average low temperature in January is 19 degrees Fahrenheit (-7 degrees Celsius).</p>',NULL,NULL,'[14,12]','203','[324]','[134,133]','[173,174]','[354,340,344,350]',5,'<p>The focus of this retreat is \"Meditation, Yoga, &amp; Living with Purpose.\" Every month, The Path of Bliss explores a new theme across our two workshops.</p><p>Recalibrate with:</p><ul><li>Amazing yet healthy food</li><li>Deep conversations with like-minded people</li><li>Fun!</li><li>A stunningly beautiful environment</li><li>Top-quality yoga classes. This is not just a bit of stretching - it’s about optimizing your health and vitality for a lifetime</li><li>A deep, blissful meditation experience that takes you way beyond stress management</li><li>Two workshops to understand the \"Why of the Yoga lifestyle\"</li></ul><p>Take three days out of your schedule to rejuvenate your whole being - it’s well worth it.</p><p>Participants are expected to arrive on Friday, starting from 4 pm onwards. This will give you ample time to settle in before our first program, which begins at 6 pm. The retreat concludes on Sunday and we typically have our departure right after lunch, around 2 pm.</p>',NULL,'NY','[\"2024-03-21:2024-04-22\",\"2024-04-17:2024-04-20\"]','<p>You may arrive by Train to the&nbsp;AMTRAK Hudson (NY) Station&nbsp;and be picked up by a $15 fee each way</p>',1,NULL,0),
(43,139,'[{\"type\":\"77\",\"price\":\"363\",\"seasonal_pricing\":[],\"deposit_percent\":\"15\",\"description\":\"<p>Bunk bed in a dorm room that can accommodate up to 6 people with shared bathrooms in the hallway. This is a female only dorm</p>\",\"photos\":[{\"name\":\"c1d7db83cc9386bfcb8fbf607d55adf4.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"948300b3aa19c7d47798583ea5bd0eed.jpeg\",\"type\":\"image/jpeg\"}]},{\"type\":\"77\",\"price\":\"363\",\"seasonal_pricing\":[],\"deposit_percent\":\"15\",\"description\":\"<p>Bunk bed in a dorm room that can accommodate up to 6 people with shared bathrooms in the hallway. This is a male only dorm.</p>\",\"photos\":[{\"name\":\"7a363c1c2610a0e6bd9f6a01fb6884ae.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"35260fa59c9a23e8a39dac9170310bfb.jpeg\",\"type\":\"image/jpeg\"}]},{\"type\":\"\",\"price\":\"\",\"seasonal_pricing\":[],\"deposit_percent\":\"\",\"description\":\"\",\"photos\":[]}]','[{\"name\":\"DADA RAINJITANANDA\",\"email\":\"dada@email.com\",\"is_yoga_alliance\":false,\"about\":\"<p>Dada Rainjitananda Avt, an Acarya (spiritual teacher) since 1984, is a yoga instructor (E-RYT500) affiliated with Yoga Alliance, USA. His journey as an acarya began in Africa, leading him across Europe from 1986 to 2000, imparting knowledge on yoga &amp; meditation.</p>\",\"photos\":[{\"name\":\"d7b9a6b31421d9ac27d976cf1a2e58d0.jpeg\",\"type\":\"image/jpeg\"}],\"location\":{\"country\":\"\",\"street\":\"test\",\"buildingName\":\"test\",\"city\":\"123\",\"state\":\"123\",\"zipCode\":\"\",\"zipcode\":\"123\"}},{\"name\":\"\",\"email\":\"\",\"is_yoga_alliance\":false,\"about\":\"\",\"photos\":[],\"location\":{\"country\":\"\",\"street\":\"\",\"buildingName\":\"\",\"city\":\"\",\"state\":\"\",\"zipCode\":\"\"}}]','Retreat',NULL,'3 Day Meditation, Yoga & Living with Purpose Retreat in NY, USA','Purling, NY 12470, USA','US','','Purling','2024-03-17 12:12:05','2024-03-17 12:12:05',1,'12470','42.2840699','-74.0201416','[219,222,221,223]','<p>Discover the life-changing potential of yoga and meditation in just three unforgettable days. Picture a serene morning, as you begin each day with a tranquil meditation and invigorating yoga session from the comfort of your own home. Feel the profound impact as you effortlessly stay focused on what truly matters to you – the meaningful work you were destined for. Now, imagine experiencing this blissful routine day after day.</p><p>Prepare to embark on an incredible journey at our upcoming weekend retreat, where we invite you to immerse yourself in the transformative practices of meditation, yoga, and purposeful living.</p>','[261,263,269,246,307]',NULL,'<ul><li>2 workshops to learn about \"The Essence of Meditation, The Essence of Yoga, and The Essence of Living with Purpose\"</li><li>6 collective meditation sessions for a deep, blissful meditation experience that takes you way beyond stress management</li><li>3 top quality yoga classes</li><li>6 vegetarian meals</li><li>Deep conversations with like-minded people and fun</li><li>A stunningly beautiful environment</li><li>2 nights accommodation</li></ul><p><br></p>','<p>Our Meditation, Yoga &amp; Living with Purpose Retreat is designed to help you learn about the essence of meditation and yoga and to experience the profound benefits of both practices in a stunningly beautiful setting. The goal of this weekend is to provide you with the knowledge and skills you need to develop a sustainable meditation and yoga practice that you can incorporate into your daily life.</p><p>Workshops:</p><p>This is a series of retreats and each time the two workshops will cover topics concerning the Essence of Meditation, the Essence of Yoga, and The Essence of Living with Purpose.</p><p>Collective Meditation Sessions:</p><p>The six collective meditation sessions will be led by experienced meditation teachers. The sessions will be designed to help you deepen your meditation practice and experience a deep, blissful state of meditation. You will learn a basic technique of mantra meditation that you can do every day at home.</p><p>Yoga Classes:</p><p>The three yoga classes will be led by experienced yoga teachers. The classes will be designed to help you improve your flexibility, strength, and balance. The classes will also be designed to help you experience the mind-body connection and develop a deeper understanding of yoga philosophy.</p><p>Vegetarian Meals:</p><p>You will be provided with six vegetarian meals during your retreat. The meals will be prepared with fresh, local ingredients and will be designed to nourish your body and mind.</p><p>Deep Conversations and Fun:</p><p>The retreat will also provide opportunities for you to have deep conversations with like-minded people and to have fun. There will be time for socializing, exploring the surrounding area, and relaxing.</p><p>Stunningly Beautiful Environment:</p><p>The retreat will be held in a stunningly beautiful environment. You will be surrounded by nature and will have the opportunity to enjoy the peace and tranquility of the setting.</p><p>Accommodation:</p><p>You will be provided with 2-nights of accommodation in a comfortable and inviting setting.</p>','[325,326,327,328]',NULL,'USD',NULL,5,1,1,'[]','yes','no',NULL,NULL,'<p>Nestled amidst a picturesque and serene landscape of the Catskills, Upstate New York, the retreat center is a hidden gem waiting to be discovered. Situated in a tranquil setting, surrounded by lush woods, pristine wetlands, open fields, and enchanting walking trails, it offers an idyllic backdrop for your transformative journey.</p><p>As you walk around, the beauty of nature envelops you, providing a sense of calm and serenity.</p>',NULL,NULL,'<p>Our retreat center is located in a four-season climate. Please pack accordingly, bringing clothes suitable for cold winters, moderate summers, colorful fall, and rainy spring.</p><p>Cairo, New York, experiences a humid continental climate with hot summers and cold winters. The average high temperature in July is 82 degrees Fahrenheit (28 degrees Celsius), and the average low temperature in January is 19 degrees Fahrenheit (-7 degrees Celsius).</p>',NULL,NULL,'[14,12]','203','[324]','[134,133]','[173,174]','[354,340,344,350]',5,'<p>The focus of this retreat is \"Meditation, Yoga, &amp; Living with Purpose.\" Every month, The Path of Bliss explores a new theme across our two workshops.</p><p>Recalibrate with:</p><ul><li>Amazing yet healthy food</li><li>Deep conversations with like-minded people</li><li>Fun!</li><li>A stunningly beautiful environment</li><li>Top-quality yoga classes. This is not just a bit of stretching - it’s about optimizing your health and vitality for a lifetime</li><li>A deep, blissful meditation experience that takes you way beyond stress management</li><li>Two workshops to understand the \"Why of the Yoga lifestyle\"</li></ul><p>Take three days out of your schedule to rejuvenate your whole being - it’s well worth it.</p><p>Participants are expected to arrive on Friday, starting from 4 pm onwards. This will give you ample time to settle in before our first program, which begins at 6 pm. The retreat concludes on Sunday and we typically have our departure right after lunch, around 2 pm.</p>',NULL,'NY','[\"2024-03-20:2024-04-22\"]','<p>You may arrive by Train to the&nbsp;AMTRAK Hudson (NY) Station&nbsp;and be picked up by a $15 fee each way</p>',1,NULL,0),
(52,148,'[{\"type\":\"76\",\"price\":\"195\",\"seasonal_pricing\":[],\"deposit_percent\":\"15\",\"description\":\"<p>Yoga and Art offer glamping stores called Eden, located in the large garden and prepared to accommodate you throughout the year, providing the opportunity to be in nature with total comfort.</p><ul><li>Each store is spacious, bright, and charmingly decorated.</li><li>They have enough space to stand and all the necessary amenities, including heating during winter months and a fan during warm months.</li><li>They are equipped with comfortable mattresses, sheets, and bedding, as well as bedside tables with light and outlets.</li><li>They are located within a short distance from the house where the bathrooms are located.</li><li>You can book them for individual use or share them if you come as a couple. Inside the store, there is a toilet and another full bathroom with a shower, both for shared use. The common areas include a breakfast area, dining area, and painting space.</li></ul><p>All accommodations are in the garden and are private, meaning you don\'t have to share them with anyone, so if you come alone, it\'s all for you, and if you come with someone or as a couple, you can share it.</p><p>There is a family of cats living on the premises, so please keep this in mind if you have allergies, although the grounds are spacious. Dogs are not allowed either, as much as we love them, the cats are afraid of them, and we must avoid stressing them out. Thank you for your understanding.</p>\",\"photos\":[{\"name\":\"74bcff849f0890af943ddfd0284c7864.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"40d1b4f493214e0274b214095db84ac1.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"440e9c66d533420b296e3b9dfe69543b.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"2880c2f3363308d3d424393842cd7337.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"22eb2383943dfe7f0ea4a2881a3eb17d.jpeg\",\"type\":\"image/jpeg\"}]}]','[{\"name\":\"AGATA AMGROS\",\"email\":\"agata@mail.com\",\"is_yoga_alliance\":false,\"about\":\"<p>With the fervent desire to connect with the Light, I embarked on the path of inner knowledge at the age of 18 when I had my first encounter with meditation and visualization.</p><p>Officially, I have pursued studies in Applied Arts, focusing on sculpture and painting, which has allowed me to understand the body in all its anatomy and beauty, and to capture that light with its shadows and forms in the material world.</p><p>My inner journey has led me through various schools and centers, exploring and immersing myself in different practices and therapies.</p><p>I have been part of Tibetan tantric Buddhism, Zen Buddhism, Hatha yoga, Ashtanga, Sivananda, Kundalini, Kriya, Aero yoga, and Nidra yoga.</p><p>Additionally, I have delved into various therapies such as Reiki, Bach flowers, family constellations, art therapy, sound therapy, and various massage techniques including Ayurveda, Swedish massage, Thai massage, lymphatic drainage, and more.</p><p>However, my true passions are painting, writing, designing, and composing. These creative activities inspire and fill me with joy.</p><p>Yoga has become an essential tool for keeping my mind centered and calm, allowing me to fully develop these creative passions.</p><p>Furthermore, I am delighted to offer these well-being tools to others, feeling happy and connected to all those who wish to share a little bit of their lives with me.</p><p>I will be delighted to connect with you and share this journey towards the Light together. Let\'s make each day a path of inspiration and inner growth!</p>\",\"photos\":[{\"name\":\"aeb5a41b60b66f7cfe60ba39e5bf0a67.jpeg\",\"type\":\"image/jpeg\"}],\"location\":{\"country\":\"\",\"street\":\"\",\"buildingName\":\"\",\"city\":\"\",\"state\":\"\",\"zipCode\":\"\"}}]','Retreat',NULL,'3 Day Aerial Yoga & Cooking Workshop in Spain','Andalusia, Spain','ES','Andalusia','Andalusia','2024-03-18 17:03:31','2024-03-18 17:03:31',1,'123','37.5442706','-4.7277528','[222,221,218]','<p>Do you need to disconnect from the routine and give yourself some time for yourself? Join this 3-day aerial yoga retreat where you can enjoy aerial yoga classes, delicious cuisine, and preparation, resting in a relaxed and welcoming atmosphere. In addition, you can enjoy meditation and relaxation sessions, as well as have free time to read and rest on the beach and pool.</p><p>The objective of Yoga and Art is that you feel comfortable and at ease during these days. For this reason, they are here to accompany you in your choice, whether you want to chat and share, or if you prefer to be silent and enjoy some time for yourself.</p>','[261,264,268,270]',NULL,'<ul><li>Daily aerial yoga classes (adapted to all)</li><li>Daily meditation and relaxation sessions with bowls of quartz bowls, mantras, and sound therapy</li><li>Vegetarian and vegan food, and above all delicious.</li><li>Arrival on any day of the week</li><li>Pool, garden, and sea views</li></ul><p><br></p>','<p>This is our schedule every day, you can come whenever you want as long as we have accommodation, and you don\'t have to wait for specific dates.</p><p>Aerial yoga classes every day as a common activity.</p><p>Day 1</p><ul><li>12:00 Arrival at this time</li><li>14:30 Lunch</li><li>19:00 Aerial yoga class, meditation, and relaxation with quartz bowls</li><li>20:00 Cooking workshop and recipe preparation</li><li>21:00 Dinner</li></ul><p>Day 2</p><ul><li>08:30 Tea</li><li>09:00 Aerial yoga class</li><li>10:30 Breakfast</li><li>13:30 Cooking workshop and recipe preparation</li><li>14:30 Lunch</li><li>19:00 Aerial yoga class, meditation and relaxation with quartz bowls</li><li>21:00 Dinner</li></ul><p>Day 3</p><ul><li>08:30 Tea</li><li>09:00 Aerial yoga class</li><li>10:30 Breakfast</li><li>13:30 Cooking workshop and recipe preparation</li><li>14:30 Farewell meal</li></ul><p>Spend some wonderful days with us and if you need to stay longer you just have to ask us and we will extend your stay</p>','[326,327]',NULL,NULL,NULL,5,1,1,'[]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'[168,167]','[150,155,146,149]','[173,175]','[344,347,350]',5,NULL,NULL,'AN','[\"2024-03-19:2024-04-16\"]',NULL,1,NULL,0),
(53,149,'[{\"type\":\"76\",\"price\":\"3673\",\"seasonal_pricing\":[],\"deposit_percent\":\"14\",\"description\":\"<p>Private room in a beautiful Old Town B&amp;B</p>\",\"photos\":[{\"name\":\"f382d0ade5c206d31c612782448fac9c.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"1ba0bcc248fc71529a7f33716cc29fbb.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"1e2fcfd4f157784668892181cd5962a5.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"e99206c7e96478724780169fc7f2d5ec.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"ada188e5f358ec63bfbb3313ca58be12.jpeg\",\"type\":\"image/jpeg\"}]},{\"type\":\"76\",\"price\":\"4316\",\"seasonal_pricing\":[],\"deposit_percent\":\"14\",\"description\":\"<p>Private Room for Two in a beautiful Old Town B&amp;B</p>\",\"photos\":[{\"name\":\"20d0af167335c12d81e409f1bc794bb6.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"92e885a687827e83c8be429075c29dbc.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"95098f8ab4e1cb3fb087071c9cca8a88.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"2f23be3c3a01289c5f83e0a7fe1d5608.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"d224722ce08e2fb058e980dc43c1738c.jpeg\",\"type\":\"image/jpeg\"}]}]','[{\"name\":\"JOLIE WILSON\",\"email\":\"jolie@mail.com\",\"is_yoga_alliance\":false,\"about\":\"<p>Having studied and practiced yoga, breath, meditation, and intuitive arts for over 23 years, Jolie believes these practices are the greatest gifts we can give ourselves and others.</p><p>As the owner of Full Circle Yoga School, a yoga teacher of 7 different yogic practices, 30+ styles of meditation, 20+ styles of Breath-work, a transformation facilitator, QHHT Level 2 - Quantum Healing Hypnosis Technique Practitioner, Trauma Release Practitioner, Musician, Shamanic Practitioner, Paddle Board Yoga Instructor, Reiki Level II Practitioner and beyond, she is ever delving deeper into these passions.</p><p>As a mother of four boys and woman who found herself embarking on a journey a bit different than expected, Jolie took a deeper turn toward these practices in 2009 when she needed healing from depression, trauma, anxiety, and panic attacks and at the time what felt like a broken life. Through consciousness raising, present moment awareness, integration, treating our body as a temple, and living life as a moving meditation Jolie teaches that when we start living from our divine essence, we remember who we are and in this creation of space within ourselves we reclaim our power and infinite ability to manifest our dreams.</p><p>Jolie has experienced and been witness to many \\\"miracles\\\" that the rational mind can not explain. She does not believe in limits, boundaries, or the finite and through that awareness she lives a magical life beyond what most people consider ordinary reality. In addition to nurturing our soul and spirit, our physical body is the temple. Keeping it strong and healthy is vital to an enlightened life. As a channel and intuit Jolie utilizes her clairvoyant abilities in a symbiotic way to offer sessions that work to integrate past traumas and emotional disturbances. Being of service to others and aiding them in healing their lives, improving their health, and living authentically is Jolie\'s life’s purpose. May you know you are powerful beyond measure. May you be free. Namaste.​</p>\",\"photos\":[{\"name\":\"1935c2e3f7bfd320fc76df35f2f028a3.jpeg\",\"type\":\"image/jpeg\"}],\"location\":{\"country\":\"\",\"street\":\"\",\"buildingName\":\"\",\"city\":\"\",\"state\":\"\",\"zipCode\":\"\"}},{\"name\":\"\",\"email\":\"\",\"is_yoga_alliance\":false,\"about\":\"<p>From a young age, Michelle was drawn towards a spiritual way of living and mind-body connection. She loved yoga right from the start, exploring many different styles. As a bilingual yoga instructor, she brings to her students a depth of experience in Hatha, Kundalini and Vinyasa style yoga. She has been dedicated to her yoga practice for nearly two decades on and off the mat, embodying the yoga lifestyle beyond asana.</p><p>In 2020 Michelle received her first Full Circle 200 hour certification, under some of the most magical facilitators. It was here, on the mystical island of Hawaii, that she felt that spark ignite her true purpose. Michelle joined Full Circle as a facilitator in early 2022 after receiving her RYT 500 and since has helped carry out the vision and mission of the school as well as leading our moon/cacao ritual ceremonies. She is dedicated to guiding, leading, teaching, and learning from you, with an abundance of love and understanding.</p>\",\"photos\":[{\"name\":\"f0db20c2ddfea8ea4d3db5a97cdab0aa.jpeg\",\"type\":\"image/jpeg\"}],\"location\":{\"country\":\"\",\"street\":\"\",\"buildingName\":\"\",\"city\":\"\",\"state\":\"\",\"zipCode\":\"\"}}]','Retreat',NULL,'5 Day Ocean Adventure & Spa Yoga Wellness Retreat in Key West, US','Key West, Florida 33040, USA','US','Key West','Key West','2024-03-18 17:56:12','2024-03-18 17:56:12',1,'33040','24.5554183','-81.7841722','[220,223,219,218]','<p>SESSION CHOICES</p><p>OCEAN ADVENTURES:</p><p>ISLAND ADVENTURE ECO TOUR</p><ul><li>Eco Tour Snorkel Kayak Paddleboard</li><li>9:30am, 3:30pm</li><li>Moderately active</li><li>4.5 Hrs</li><li>Food &amp; Beverages</li></ul><p>DOLPHIN WATCH ECO TOUR</p><ul><li>Eco Tour Backcountry Snorkel</li><li>9:00am, 12:30pm, 5:00pm</li><li>.3 Hrs</li></ul><p>DOUBLE DIP SNORKEL SUNSET COMBO</p><ul><li>Snorkel 2 Reef Locations</li><li>9:00am, 12:30pm, 5:00pm</li><li>Moderate</li><li>3 Hrs</li></ul><p>DOLPHIN WATCH SUNSET CRUISE COMBO</p><ul><li>Eco Tour Backcountry Snorkel Sunset</li><li>9:00am, 12:30pm, 5:00pm</li><li>Low</li><li>3 Hrs</li></ul><p>DOUBLE DIP SNRKEL SUNSET COMB0</p><ul><li>Snorkel 2 Reef Locations</li><li>9:00am, 12:30pm, 5:00pm</li><li>Moderate</li><li>3 Hrs</li></ul><p>DOLPHIN WATCH SUNSET CRUISE COMBO</p><ul><li>Eco Tour Backcountry Snorkel Sunset</li><li>9:00am, 12:30pm, 5:00pm</li><li>Low</li><li>3 Hrs</li><li>Beverages</li></ul><p>ISLAND ADVENTURE&amp;SUNSET CRUISE COMBO</p><ul><li>Eco Tour Snorkel Kayak Paddleboard Sunset</li><li>9:30am, 3:30pm</li><li>. Moderate</li><li>4.5 Hrs</li><li>Food &amp; Beverages</li></ul><p>DOUBLE DIP SNORKEL TRIP</p><ul><li>Snorkel 2 Reef Locations</li><li>9:00am, 12:30pm, 5:00pm</li><li>Moderate</li><li>3 Hrs</li><li>Beverages, Water, Juice</li></ul><p>KEY WEST SNORKELING</p><ul><li>Morning Reef Snorkel 9:30am</li><li>Moderate</li><li>3 Hrs</li><li>Beverages</li></ul><p>KEY WEST SUNSET CRUISE</p><ul><li>Sunset Cruise Champagne</li><li>6:00pm</li><li>2 Hrs</li></ul><p>PARASAILING</p><ul><li>Soar Above the Emerald Blue Waters of Key West</li><li>Enjoy Breathtaking Bird\'s Eye Views of this Island Paradise</li><li>Ocean Dip Option</li><li>Departs on the Hour Every Hour</li><li>Tandem &amp; Triple Rides</li><li>Gentle Dry Takeoffs</li></ul><p><br></p>',NULL,NULL,'<p>Stay in a beautiful Key West B&amp;B within walking and biking distance to our studio, Evlove Key West, beaches, art, culture, historical sites, theater, restaurants, nightlife, and more! Wind down from your day with yoga under the palm trees. Explore the beauty and the local culture of our little island paradise!</p><p>Key West, the southernmost location in the continental United States, offers a tropical blend of azure waters, exotic foliage, four-star restaurants, to suit all and with a history of some notorious and notable figures. Visitors are drawn to the southern charm and Caribbean flavor of this laid-back island nation called the Conch Republic.</p><p>Key West, Florida is home to the only living barrier reef in the continental United States! How cool is that? The Florida Reef is found about 6-7 miles offshore of Key West. That’s only a short boat ride away!</p><p>Since its founding in 1822, Key West became the adopted homes to many from pirates to poets and political pundits. The city carries the creative torch of such former residents as Ernest Hemingway, Tennessee Williams and past presidents. Must stops for tourists include viewing the treasures from shipwrecks, discovering the haunts of their literary heroes, and marveling at the Victorian architecture and lush, colorful gardens where heads of state frequented. Key West also offers sun-drenched hospitality and entertainment from delicious island cuisine to delightful shopping and spectacular events including nightly sunset celebrations and sea adventures.</p><p>You\'ll discover why President Harry Truman, relaxing in his Winter White House, once wrote: \"I\'ve a notion to move the capital to Key West and just stay.\"</p>',NULL,NULL,NULL,'USD',NULL,5,NULL,NULL,'[]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'203','[168]','[134,135,133]','[173,174,175]',NULL,5,'<p>4 Nights Lodging</p><p>2 Ocean Adventures of Your Choosing</p><p>2 Two Hour Spa Sessions- Massage</p><p>Bike Rental</p><p>Unlimited Yoga Classes</p><p>Stay in a beautiful Key West B&amp;B within walking and biking distance to our local partnering yoga studio, beaches, art, culture, ​historical sites, theater, restaurants, nightlife, and more!</p><p>​Key West, the southernmost location in the continental United States, offers a tropical blend of azure waters, exotic foliage, four-star restaurants, to suit all and with a history of some notorious and notable figures. Visitors are drawn to the southern charm and Caribbean flavor of this laid-back island nation called the Conch Republic. Since its founding in 1822, Key West became the adopted homes to many from pirates to poets and political pundits. The city carries the creative torch of such former residents as Ernest Hemingway, Tennessee Williams and past presidents. Must stops for tourists include viewing the treasures from shipwrecks, discovering the haunts of their literary heroes, and marveling at the Victorian architecture and lush, colorful gardens where heads of state frequented. Key West also offers sun-drenched hospitality and entertainment from delicious island cuisine to delightful shopping and spectacular events including nightly sunset celebrations and sea adventures. You\'ll discover why President Harry Truman, relaxing in his Winter White House, once wrote: \"I\'ve a notion to move the capital to Key West and just stay.\"</p>',NULL,'FL','[\"2024-04-14:2024-04-25\"]',NULL,1,NULL,0),
(60,152,'[{\"type\":\"77\",\"price\":\"1840\",\"deposit_percent\":\"14\",\"description\":\"<p>Cozy up in our newest 20 foot yurts encircled by young oak and cedar trees.</p><p>The height of this yurt makes it feel super spacious yet cozy!</p><p>The beautiful skylight dome offers amazing nighttime views of the moon and stars! You’ll have access to a communal outdoor kitchen and a brand-new toilet and sink combo right by the spiral garden.</p><p>Amenities include:</p><ul><li>Private entrance</li><li>Luggage drop off for early arrival or late departure</li><li>Free parking on the premises</li><li>Steps away from our new communal outdoor bathroom with shower, toilet, and sink!</li></ul><p>The price is for one person\'s single occupancy.</p>\",\"photos\":[{\"name\":\"e70f866fb979ff0f757fb9ca6c8b254b.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"89d030c4c7ba880778a15d517d5b38f6.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"eb361a90f490feb81fccffef58dd7575.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"cc228a6ccb741e486f31eeeb599b0546.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"7c5c865c10a38f7205eb2e66914cce7c.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"dd80b4ffe135937bf1a43ef658eaffb5.jpeg\",\"type\":\"image/jpeg\"}]}]','[{\"name\":\"AIYISHA CASTILLO\",\"email\":\"aiy@gmail.com\",\"is_yoga_alliance\":\"false\",\"about\":\"<p>SOMATIC THERAPY, MASSAGE &amp; MOVEMENT</p><p>Aiyisha’s passion is to support humans in building a deeper relationship with their bodies.</p><p>She spent the last two decades studying psychology, trauma, human development, and holistic healing practices. She’s devoted her life’s work to educating and offering profound, life-changing experiences with a focus on integration and wholeness.</p>\",\"photos\":[{\"name\":\"0fbec90ece8f21001d908226464fc22a.jpeg\",\"type\":\"image/jpeg\"}],\"location\":{\"country\":\"\",\"street\":\"\",\"buildingName\":\"\",\"city\":\"\",\"state\":\"\",\"zipCode\":\"\"}}]','Retreat',NULL,'7 Day Savor Sacred Silence Retreat in Nature, US',NULL,'US','6101 Walden Brook DR Lithonia','Deklab','2024-03-22 20:38:51','2024-03-22 20:38:51',1,NULL,'33.7002447','-84.1562392','[223,224,377,217]','<p>Savoring sacred winter silence retreat is a six-night journey into the depth and stillness of winter through sacred silence.</p><p>Join us for our special 6-night seasonal silent retreats to help you slow down, rest, and root deeply into your winter visions with the support of Hestia’s wise cedar, oak, and pine trees.</p><p>When you befriend silence, your other senses can awaken to guide you in imagining bold new possibilities for your life! It\'s the perfect way to start the new year with greater purpose, healing, and intention!</p>','[261,264,268,269]',NULL,'<p>Exhausted and overwhelmed? Struggling with a major life or job change? Needing a reset to get grounded, clear and inspired again?</p><p>Seeking a special place to celebrate your birthday or life milestone?</p><p>Craving a creative space to write your book or incubate your vision?</p><p>Come back home to yourself with the enchanted forest and flowing waters of Hestia. Let Mother Earth and her changing moons and seasonal cycles be your guide.</p><p>Slow down and unplug. Savor the silence. Hear the whispers of your wildest, truest desires calling you.</p>','<p>A six-night journey into the depth and stillness of winter through sacred silence.</p><p>Stillness and silence are powerful ways to receive the intuitive, mysterious gifts of the winter season.</p><p>Join us for our special 6-night silent retreats to help you slow down, rest, and root deeply into your winter visions with the support of Hestia’s wise cedar, oak, and pine trees.</p><p>When you befriend silence, your other senses can awaken to guide you in imagining bold new possibilities for your life!</p><p>This journey is limited to 6 people on the land each week.</p><p>This is the perfect opportunity if you desire:</p><ul><li>Greater alignment between your lifestyle and nature’s rhythms</li><li>More slowness and quiet time in wintering</li><li>Guided support to navigate this darker time of the year</li><li>Sacred space to go deeper into your resting, visioning, and dreaming states</li></ul><p><br></p>',NULL,NULL,'USD',NULL,3,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'[203,206]','[166,162]',NULL,'[173,174,175]',NULL,6,NULL,NULL,'GA','[\"2024-04-01:2024-04-26\"]',NULL,2,'<p>This is test.</p>',0),
(62,153,'[{\"type\":\"76\",\"price\":\"989\",\"deposit_percent\":\"14\",\"description\":\"<p>These two queen bedrooms have private en-suite bathrooms &amp; spa tubs. They are on the first floor of the Inn.</p><p>Should either one of these bedrooms be shared, the price per person would be $870 with 3 meals/day, spa offerings &amp; activities included.</p>\",\"photos\":[{\"name\":\"dfdd11e59fb1e4d8a4961efe288d8a17.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"f0ff967d46aa0441c6372086cd7c7f80.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"216ed72504c67c27609d7242af6449ce.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"63bd21b07cae806638cea0d949110f19.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"0d29270c8ea6a51aef2d8771405be7f6.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"db5873f9473d2ad6155c107a46d298ec.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"5a7809279b139a8ba75a70e9c45a015c.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"33b9a0b67b0524c7ae12cceee1f81c7b.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"222d2990c5ee4bf457dc441bc18c0b7b.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"c0af907404645bbe98fce25b15141f41.jpeg\",\"type\":\"image/jpeg\"},{\"name\":\"f892430c3219d6663cf01859964f78b1.jpeg\",\"type\":\"image/jpeg\"}]}]','[{\"name\":\"\",\"email\":\"\",\"is_yoga_alliance\":\"false\",\"about\":\"\",\"photos\":[],\"location\":{\"country\":\"\",\"street\":\"\",\"buildingName\":\"\",\"city\":\"\",\"state\":\"\",\"zipCode\":\"\"}}]','Retreat',NULL,'4 Day Lavender Yoga Retreat in New Hampshire, US',NULL,'BR','Cabo','Cabo de Santo Agostinho','2024-03-24 22:30:25','2024-03-24 22:30:25',1,NULL,'-8.2865053','-35.0365913','[373,222,218,377]',NULL,NULL,NULL,'<p>Our secret ingredient is that we are the owners of an elegant Inn &amp; Spa which lies in one of the most beautiful areas of New England - at the virtual junction of Mount Sunapee &amp; Lake Sunapee State Park Beach.</p><p>We limit our guests to a maximum of 8 at any one point in time which allows for a very personalized service.</p><p>On-site offerings include, meditation, massage, Infrared sauna &amp; three hearty meals provided by our French-trained Chef/Cook.</p><p>Yoga takes place either at, the summit of Mount Sunapee or the beach of Lake Sunapee or beside our brook &amp; other locations depending on weather &amp; other circumstances.</p><p>Pick up/Drop off service from Manchester &amp; Boston Logan airports can be arranged for an additional fee.</p>','<p>Aqua Inn &amp; Spa would like to make your Retreat a one of the kind individualized experience!</p><p>Come rejuvenate with us. Enjoy spa offerings &amp; many other activities with your friends, family, or new acquaintances for a few days of well-earned rest &amp; relaxation.</p><p>Your tinerary includes the following but is subject to adjustment due to weather &amp;: other circumstances.</p><p>Onsite offerings include:</p><ul><li>One 30 min. massage</li><li>infrared sauna</li><li>a Salt /meditation room</li><li>On/off site Yoga</li><li>make your own unlimited juices as well as three hearty meals a day</li></ul><p>Activities to nearby places includes a visit to a Lavender farm as well as one or more of the following: A chairlift ride to the top of Mt Sunapee where incredible views abound,, a 1 1/2 hour cruise of Lake Sunapee, a visit to a Glassmaking &amp; wood turning factory in Vermont, the Historic Hayes Estate &amp; Gardens, Quechee Gorge, Woodstock or New London for shopping &amp; intrigue as well as hiking the well secluded BogTrail - weather, etc permitting</p><p>Your time with us is precious &amp; we strive to make your stay as special as possible.This is your retreat, your participation in our offerings is purely up to you.</p><p>Your hosts are qualified as Holistic Doctor,, Health Coach, World Record Holder, Physical Therapist, Yoga Instructor, Personal trainer, First Responder as well as a French trained Chef/Cook.</p><p>Hoping you\'ll join us in the stunning Granite State of New England.</p>','[325,327,328]',NULL,'USD',NULL,5,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'[209,208]','[165]','[142,150]','[173,174,175]',NULL,5,NULL,NULL,'PE','[\"2024-04-09:2024-04-17\"]',NULL,1,NULL,20);
