(905,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Ich hatte leider einen sehr kurzen Aufenthalt, da ich lediglich auf der Durchreise war. Allerdings kann ich die Location von Elsa nur empfehlen... Alles sehr schick und sauber... Aber vor allem sehr Herzlich... Würde wieder kommen...',5,NULL,0,0,'2021-04-10 08:20:43','2021-04-10 08:20:43',0,1,NULL,'Andy','https://www.airbnb.de/rooms/48268802/reviews','März 2021'),
(906,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Gute Lage, sehr nette Gastgeberin. Leider war ich nur für kurze Zeit Gast, ich kann mir aber gut vorstellen, dass man dort auch eine längere Zeit verbringen kann. Nur zu empfehlen.',5,NULL,0,0,'2021-04-10 08:20:43','2021-04-10 08:20:43',0,1,NULL,'Christian','https://www.airbnb.de/rooms/48268802/reviews','Februar 2021'),
(965,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Schöne ruhige und zentrale Lage, sehr sauber, ausreichende Ausstattung- für einen Kurztrip empfehlenswert!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Madita','https://www.airbnb.de/rooms/31289582/reviews','Juli 2020'),
(966,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Super sauber und ein toller Ausgangpunkt für Wanderungen',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Anna','https://www.airbnb.de/rooms/31289582/reviews','Juli 2020'),
(967,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Absolute Empfehlung! Die Wohnung war super sauber und gut gepflegt, die Küche war toll ausgestattet, der Blick auf den Gipfel war wunderschön. Gemütlich, man kann toll entspannen, die Lage ist perfekt, man kann super parken und ziemlich alles fußläufig in guter Zeit erreichen. Wir sind absolut zufrieden und dankbar GP in dieser Unterkunft erleben zu dürfen! Die Gastgeber sind auch freundlich und nett und stellen immer sicher, dass man alles hat, was man braucht, sind gut erreichbar und haben immer ein Lächeln parat. Gerne wieder!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Mirela','https://www.airbnb.de/rooms/31289582/reviews','Juni 2020'),
(968,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','saubere Unterkunft, toller Ausblick vom Balkon. Sehr empfehlenswert!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Patrick','https://www.airbnb.de/rooms/31289582/reviews','Juni 2020'),
(969,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Wohnung war für unseren Aufenthalt in Ordnung.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Lea','https://www.airbnb.de/rooms/31289582/reviews','Juni 2020'),
(970,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Wohnung ist wie beschrieben.Sie ist sehr sauber und enthält alles was man benötigt. Klein aber fein. Die Aussicht auf die Olympiaschanze vom Balkon ist toll. Wir haben uns sehr sehr wohl gefühlt. Die Gastgeber haben uns sehr herzlich empfangen und es lief alles ohne Probleme. Ich kann es nur weiterempfehlen',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Nadine','https://www.airbnb.de/rooms/31289582/reviews','August 2019'),
(971,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Positiv: Tolles Einrichtung Super Lage & Aussicht Ruhig Sehr sauber Negativ: Deckenhöhe/ Türrahmen für große Menschen schwierig Details fehlten wie Pfeffer, Seife. Sehr wenig Küchen Utensilien',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Sören','https://www.airbnb.de/rooms/31289582/reviews','August 2019'),
(972,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Es war alles zu unserer Zufriedenheit. Ruhige und schöne Lage mit direktem Blick vom Balkon auf die Skisprungschanze und aus den Fenstern in Richtung Zugspitze. Kommunikation, Schlüsselübergabe, usw. haben wunderbar funktioniert. Wir kommen gerne wieder!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Christian','https://www.airbnb.de/rooms/31289582/reviews','Juli 2019'),
(973,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Nachdem wir die Check In Zeit um ca. 20min nicht geschafft hätten, wurden wir darauf hingewiesen, daß nach 20Uhr keine Anreise (laut Richtlinien) mehr möglich ist, welches mir Telefonisch vom Verwalter bestätigt wurde!! Deswegen gab es keinen Aufenthalt in der Ferienwohnung!!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Sigmund','https://www.airbnb.de/rooms/31289582/reviews','Mai 2019'),
(974,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Unser Aufenthalt in der “Kleinen Auszeit” war perfekt. Kontakt, Schlüsselübergabe, alles perfekt! Die Wohnung ist absolut gemütlich, wir haben uns sofort wie zu Hause gefühlt. Die Lage ist top, toller Blick vom Balkon auf die Berge und die Sprungschanze. Wir kommen gerne wieder!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Andrea','https://www.airbnb.de/rooms/31289582/reviews','April 2019'),
(975,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Klasse kleine Wohnung zum Wohfühlen !',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Matthias','https://www.airbnb.de/rooms/31289582/reviews','März 2019'),
(976,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Pro:\n- sehr saubere und gepflegte Wohnung/ Ausstattung\n- schöne Lage, gute Erreichbarkeit\n- super Blick vom Balkon\n\nContra:\n- Launische, unberechenbare Kommunikation\n- Folgende Situation fand ich mehr als unangebracht: ich war als offensichtlich Schwangere auf dem Weg aus der hier gemieteten Wohnung und sage auch noch, dass wir etwas durcheinander sind und auf dem Weg zum Arzt (ich bin zuvor gestürzt und gehe in meinem Urlaub nicht zum Spaß zum Arzt). Anstatt das Sie besorgt/hilfsbereit waren, haben Sie in einem sehr unfreundlichen Ton gesagt, dass das nicht Ihr Problem sei und keine Entschuldigung dafür, dass wir die Balkontür offen gelassen haben (Heizkosten). Wie kann man nur so wenig Verständnis/Mitgefühl haben, vor allem wenn wir uns dafür schon direkt entschuldigt haben und dir Tür sofort schlossen?\n\nZudem hielten Sie uns vor, dass wir die Vorhänge an den Fenstern geöffnet haben (diese konnte man innerhalb von 3 Sekunden wieder schließen, also keine komplizierte Konstruktion). Dies schien auch auf Nachfragen ein Grund zur cholerischen Aufregung zu sein. Sind Vorhänge nicht dazu da, geöffnet zu werden?\n\n!!!Ich wünsche Ihnen alles Gute und hoffe, dass Sie NIE auf solche Menschen wie sich selbst treffen, wenn Sie in einer Notlage sind!!!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Jenny','https://www.airbnb.de/rooms/31289582/reviews','Februar 2019'),
(977,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Wohnung ist mit Liebe zum Detail und sehr zweckmäßig eingerichtet und bietet alles, was man für eine kleine Auszeit benötigt. Geschäfte, Restaurants und Ausflugziele befinden sich in unmittelbarer Nähe. Gerne wieder.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Martina','https://www.airbnb.de/rooms/31289582/reviews','Februar 2019'),
(978,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Super Gastgeber! Tolle Wohnung, perfekt fürs Wandern oder Skifahren!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Dennis','https://www.airbnb.de/rooms/31289582/reviews','Januar 2019'),
