(982,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Marks place was a great base for our short stay in GP. The apartment was sparkling clean and had all that we needed for our stay. The only minor point for us was that the bath only had a handheld shower attachment, and we didn\'t realise this from the listing, however, this is our personal preference only and we appreciated it was probably due to the low ceiling heights. The apartment is located in a quiet residential area, with a 10/15-minute walk into the centre of GP, with free parking on the street outside which was a bonus for us.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Caroline','https://www.airbnb.de/rooms/31289582/reviews','September 2019'),
(983,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Bel appartement , proprete irréprochable a 600 m des commerces de Partenkirchen .',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'François','https://www.airbnb.de/rooms/31289582/reviews','August 2019'),
(984,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We had a lovely stay in Mark\'s place. It was sparkling clean, it had everthing that we needed and the bed was very comfortable. The view is absolutely amazing. Communication from him was quick and we were met by both him and his wife upon arrival. He also gave us some great local tips. We will definitely be back in future and can higly recommend his place.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Carlien','https://www.airbnb.de/rooms/31289582/reviews','August 2019'),
(985,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Mark’s place was in a great location. We were able to leave from the front door and go for hikes. The views from the balcony and windows were incredible. The kitchen was very small which was okay but it lacked a few items that would’ve been very helpful (there were no plates at all and only very big and very small bowls). The ceilings and doorways in the place are also very low which is hard to tell from the pictures. We had to crouch through some doorways and in the shower. Mark was prompt and professional with check in and check out. Overall, Mark’s place was a good fit for our time in GP!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Murray','https://www.airbnb.de/rooms/31289582/reviews','August 2019'),
(986,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Mark has a great apartment. The town is lovely and the walk to the center and the train station and bus stops is not bad at all. About 10-15 minutes along the river! The best thing about the accommodation is the lovely view of the mountains from the balcony.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Gareth','https://www.airbnb.de/rooms/31289582/reviews','Juli 2019'),
(987,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','A comfortable flat in a quiet area. All facilities although the kitchen is fairly basic. Lovely views of the mountains from the balcony. Mark is a brisk and efficient host. If you don\'t have a car it is a pleasant 15 mins walk to the station and a further 10 to Garmisch town centre. Flat is ideally placed for Partnach gorge (20 mins away.) No wifi in the flat. All in all a very pleasant stay.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'A','https://www.airbnb.de/rooms/31289582/reviews','Juli 2019'),
(988,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The apartment has great views of the mountains and the ski jump. Handy to bus service or a 10-15 minute walk to town. The kitchen is quite basic with 2 burners and a kettle. No microwave or toaster. Only 2xsaucepans and 1 small fry pan. We cooked a couple of very basic meals. It is probably not an issue if you eat out each night. We enjoyed our stay.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Noela','https://www.airbnb.de/rooms/31289582/reviews','Juni 2019'),
(989,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great location for hiking the Zugspitze, lovely apartment!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Cybele','https://www.airbnb.de/rooms/31289582/reviews','Juni 2019'),
(990,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We had a nice stay. The apartment was great and had a very nice view. Was also very cozy and had everything we needed.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Soha','https://www.airbnb.de/rooms/31289582/reviews','Juni 2019'),
(991,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','My wife and I thoroughly enjoyed our stay at Mark’s apartment in Garmisch. We found it to be clean, quiet, and comfortable. It is located on a side street, with adequate parking and a pleasant walking path nearby. Garmisch is a beautiful town, and we enjoyed wandering around the downtown area visiting cafés, shops, and bäckereis. We also enjoyed looking at the beautiful scenery. This is definitely on our list of “visit again” places.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'William','https://www.airbnb.de/rooms/31289582/reviews','Mai 2019'),
(992,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Nice and clean apartment with easy access to the downtown. The accommodation provided us everything we needed. We enjoyed also bus passes that host provided. I recommend to be on time on check-in, otherwise you will get a \"nice\" welcome. I was late 13 min and the host was little bit unpleasant.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Ľubica','https://www.airbnb.de/rooms/31289582/reviews','Februar 2019'),
(993,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Mark’s apartment is lovely and very well located halfway between Garmisch and the Olympic Ski jump. It is an excellent start point if you would like to explore Partnachklamm, which I would heartily recommend. It is about a 20 minute walk from the train station. The apartment was very clean and comfy and we loved our stay.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'James','https://www.airbnb.de/rooms/31289582/reviews','Februar 2019'),
(1071,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Es war einfach super! Man hat dort eine wunderschöne Aussicht! Die Gegend ist wunderschön und man kommt zu allem schnell hin! Die Kommunikation und die Abwicklung waren freundlich, schnell und reibungslos! Gerne wieder!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Anuschka','https://www.airbnb.de/rooms/19774742/reviews','Oktober 2020'),
