(1074,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Tolle Unterkunft, die ihren Teil zu unserem entspannten Urlaub beigetragen hat. Wir hatten die ersten beiden Tage ein bisschen Pech mit dem Wetter, was aber aufgrund der schönen Wohnung mit dem wunderschönen Alpenpanorama nicht weiter schlimm war. Die online gestellten Fotos bilden die Wohnung authentisch ab. Peter war als Gastgeber zwar nicht vor Ort, hat aber umgehend auf Mails und Anfragen reagiert und war jederzeit offen, superfreundlich und hilfsbereit. In dem Haus selbst wohnt zudem eine weitere Kontaktperson, die bestimmt auch jederzeit geholfen hätte, wenn wir was benötigt hätten. Die städtische Baustelle vor dem Haus, die sich dort gerade befindet, war auch nicht wirklich störend. Von daher bleibt mir nur zu sagen: Wer im Gebiet Garmisch-Partenkirchen seinen Urlaub verbringen möchte, dem kann ich Peter und seine Wohnung nur wärmstens empfehlen. Danke!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Jung-Hun','https://www.airbnb.de/rooms/19774742/reviews','Oktober 2020'),
(1075,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Tolle Unterkunft und Ort, herrliches Panorama vom Balkon aus. Zugspitze, Eibsee und Höllental sind in unmittelbarer Nähe erreichbar! Gerne wieder!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Jascha','https://www.airbnb.de/rooms/19774742/reviews','September 2020'),
(1076,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Geräumige Wohnung mit schönen Bädern und tollem Ausblick in die Berge. Alles vorhanden was man braucht. Der Check-in und Check-ourt mit der Schlüsselbox hat super geklappt. Der Holzboden knarzt, was nachts vor allem die Personen stören kann, die im oberen Bereich schlafen. Die Gästekarten waren leider nicht vorbereitet, wir hätten sie aber in der Touristen-Info ausdrucken lassen können. Die Kommunikation mit Peter hat gut und schnell funktioniert.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Kerstin','https://www.airbnb.de/rooms/19774742/reviews','September 2020'),
(1077,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sehr schöne Unterkunft in Obergrainau. Unkomplizierte, nette Vermietung.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Lukas','https://www.airbnb.de/rooms/19774742/reviews','August 2020'),
(1078,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Wohnung ist wirklich super schön und für größere Gruppen geeignet (allerdings sollte man sich bewusst sein, dass einige Schlafplätze offen sind, steht aber auch so in der Beschreibung). Die Bäder waren beide sehr schön und sauber. Auch sonst war alles sauber außer einige Teller. Schöne Aussicht von den Balkonen. Die Bauarbeiten haben uns nicht gestört, nur die nahestehende Kirche hat uns schon früh geweckt. Wir würden wieder kommen!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Jana','https://www.airbnb.de/rooms/19774742/reviews','August 2020'),
(1079,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Das großzügige Raumgefühl und der Balkon als Logenplatz, um den Dorfplatz zu beobachten, haben uns besonders gefallen. Die Angaben und Fotos entsprechen der Wohnung, so wie wir sie vorgefunden haben. Schöne Randlage im Oberdorf in einer quirligen und stark besuchten Ferienregion. Sehr empfehlenswert!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Petra','https://www.airbnb.de/rooms/19774742/reviews','August 2020'),
(1080,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Es war sooo schön! Peter & Annika waren tolle Gastgeber! Die Kommunikation lief einwandfrei und sie waren sehr entgegen kommend. Die Wohnung sieht in echt noch viel schöner aus, sie war blitzsauber und es war einfach herrlich mit diesen Ausblick in den Tag zu starten. Wirklich sehr zu empfehlen! Vielen Dank nochmal & bis hoffentlich bald mal wieder :)',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Gabi','https://www.airbnb.de/rooms/19774742/reviews','August 2020'),
(1081,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Klasse Unterkunft. Es war, wie es beschrieben wurde; nichts geschönt oder ausgelassen. Einfach eine tolle Wohnung zum Wohlfühlen. Die Lage ist klasse, mit Blick auf die Bergwelt, kurze fußläufige Wege zum Bäcker (übrigens ein echter Super-Bäcker), zu Restaurants, Metzger, kleiner Supermarkt und zur Bahnstation der Zugspitzbahn. In alle Richtungen ist man sofort auf den gut ausgeschilderten Wanderwegen. Und wenn man doch mal mit dem Auto fährt, ist am Haus immer ein Parkplatz. Die Wohnung selbst ist voll ausgestattet, Geschirr und Besteck ist mehr als ausreichend und aus einem Wurf (keine gesammelten Generationen-Nachlässe), gemütliche Betten und Sofas. Im Vorfeld war die Kommunikation zu Peter schon schnell, sauber, präzise, und das hat sich fortgesetzt. Für die wenigen offenen Fragen, die vor Ort waren, kam immer prompt und klar eine Antwort und Hilfe. Kurzum: das war nicht unser letztes Mal dort :-)',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Thomas','https://www.airbnb.de/rooms/19774742/reviews','August 2020'),
(1082,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Wohnung war super geräumig für uns vier, zwei Erwachsene und 2 Kinder. Ausstattung war super. Betten waren auch gut, der Blick herausragend. Die Dielen knarzen wirklich ordentlich, es sollte kein Frühaufsteher in der Gruppe sein, sonst sind alle wach ;-) wir kommen wieder. Uns hat es sehr gut gefallen, trotz Dauerregen. Tipp: mit der Kurkarte kostenlos ins Wellenbad in Garmisch.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Bianca','https://www.airbnb.de/rooms/19774742/reviews','August 2020'),
(1083,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Unterkunft liegt sehr zentral. Eine Bushaltestelle ist in der Nähe, somit viele Ziele ohne Auto erreichbar. Mehrere Wandertouren starten in unmittelbaren Nähe. Es ist sehr gepflegte, saubere Unterkunft. Alles was man braucht ist vorhanden. Das Check-in unkompliziert und schnell. Auf jeden Fall zu empfehlen.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Ludmilla','https://www.airbnb.de/rooms/19774742/reviews','August 2020'),
