(1087,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Ein wundervoller Aufenthalt, der gerne noch länger hätte sein können! Die Galerie-Wohnung war super sauber, ordentlich & einfach ein Traum! Alles wie online beschrieben. Der Besitzer hat mir vorab eine nette Nachricht geschrieben, in der vieles beschrieben war. Über eine Schlüsselbox konnten wir unkompliziert einchecken. Von der Unterkunft aus konnten wir direkt zur Höllentalklamm wandern. Die Lage ist einwandfrei. Wir kommen gerne wieder. Vielen lieben Dank! Liebe Grüße aus Nürnberg',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Laura','https://www.airbnb.de/rooms/19774742/reviews','Juli 2020'),
