(1094,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wir waren zu acht in Peters Wohnung. Darunter zwei Kinder (13 und 18 Monate), die in der Wohnung gut zurecht kamen. Es waren ein Kinderbett und ein Kinderstuhl bereits vorhanden. Die Wohnung würden wir \"kindersicher\" beschreiben, wenn man das Sofa vor die Treppe stellt. Der Ort bot für Spaziergänge gute Ausgangsmöglichkeiten und die Skigebiete drumherum sind für Familien perfekt. Auch die Kommunikation mit Peter hat hervorragend funktioniert, und vor Ort war auch noch jemand, den man notfalls um Hilfe bitten konnte. Ich kann diese Unterkunft nur wärmstens empfehlen.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Sebastian','https://www.airbnb.de/rooms/19774742/reviews','Februar 2020'),
