(1133,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Ferienwohnung am oberen Dorfplatz in Grainau ist ein wahres Juwel! Nicht nur die Lage ist optimal (kurzer Weg zur Zahnradbahn, Bäcker und Lebensmitteleinzelhandel sowie viele Restaurant gleich um die Ecke, Eibseenähe etc.), sondern auch die Wohnung selbst lässt einen vom ersten Augenblick an den Urlaub genießen. Die Bilder halten absolut das, was sie versprechen: Sauberkeit, eine liebevolle Einrichtungsweise, Gemütlichkeit, Großzügigkeit. Die Kommunikation vorab und auch während unseres Aufenthaltes war jederzeit einwandfrei. So konnten wir Peter problemlos kontaktieren, um zu fragen, ob man den Kachelofen anschüren darf oder um eine neue Glühbirne zu erhalten. Spitze!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Theresa','https://www.airbnb.de/rooms/19774742/reviews','Januar 2018'),
