(1142,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wir hatten die Unterkunft für einen kurzen Familientrip gebucht (zu dritt) und die Bleibe war einfach nur genial. Peter hatte uns vorab über unsere Bedürfnisse befragt (ua Kinderbett) und alles vorbereitet. Die Kommunikation im Vorfeld war super und absolut hilfreich. In der Wohnung dann: Alles super neu und modern eingerichtet. Dazwischen wurden ein paar originale Holzbacken verbaut. Echt toll und gemütlich. Zusätzlich gibt es zwei Balkone mit genialer Aussicht auf dem man auch speisen kann. (Kaffee gibt es übrigens inklusive!!). In unmittelbarer Nähe gibt es tolle lokale Restaurants, Bäcker und nen kleinen Lebensmittelladen für den täglichen Bedarf. Wären gerne länger geblieben aber wir kommen definitiv zurück-auch weil Peter (plus Familie) einfach tolle Gastgeber sind.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Oliver','https://www.airbnb.de/rooms/19774742/reviews','August 2017'),
