(1158,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Absolutely amazing apartment and location. Highly recommended!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Donnachad','https://www.airbnb.de/rooms/19774742/reviews','August 2017'),
(1159,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','It is a wonderful place. First: location, location, location, at the top of the village, many walks accessible without needing a car, an absolutely stunning view onto Germany\'s highest mountain, the Zugspitze. The flat has windows in three directions (and terraces in two), one bedroom faces due East and lets an amazing amount of light in, the sitting room and its terrace let you watch the sun go down, magical. It provides lots of space for two couples, and would accommodate another 4 to 5 kids (or young people who do not need a lot of privacy as the other beds are on a gallery open to the main sitting/eating/kitchen space). We did not miss any equipment. What my husband and I enjoyed particularly was sitting in the hammocks on the gallery in the evening letting our souls and feet relax gently overlooking the flat. A perfect mountain retreat.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Katharina','https://www.airbnb.de/rooms/19774742/reviews','September 2020'),
(1160,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Peter\'s apartment is centrally located. It was very spacious and clean. There are balconies with really nice views of the mountains. If you are in the Garmisch region, I would definately recommend you to stay in the space.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Abhishek','https://www.airbnb.de/rooms/19774742/reviews','Juli 2020'),
(1161,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This spot is in an ideal location. You are right at the foot of the mountains and only moments from trails that will take you to all the sights including the Zugspitze, Eibsee, and Hoellentalklamm (which was closed due to washout in June 2020). The views are fantastic from the apartment and there are three patios to enjoy. The sounds of the livestock grazing in the fields was a highlight as they all wear bells. That added to the charm of the location. There are also restaurants within walking distance and one that is just down the street and with very good food. This place would be perfect for a large family as it has two private rooms downstairs and an open loft that sleeps around five people upstairs.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Rick','https://www.airbnb.de/rooms/19774742/reviews','Juni 2020'),
(1162,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Peter’s apartment was perfect for a holiday on the slopes. A great space that was brilliantly stocked.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Amelia','https://www.airbnb.de/rooms/19774742/reviews','März 2020'),
(1163,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Absolutely perfect place to spend time in Bavaria. Grainau is close to many attractions, has walking trails available right from the apartment and is so beautiful. The apartment is spacious, clean and so comfortable. There is a fireplace for cosy evenings after a day exploring. There are great restaurants within walking distance as well as a delicious bakery. We had a wonderful family reunion. Peter is quick to respond to questions and offers good suggestions for what to do and where to eat.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Lisa','https://www.airbnb.de/rooms/19774742/reviews','März 2020'),
