(1165,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Peter’s place was bright and clean and comfortable. It was well situated for our ski trip—just a short drive to Lermoos and the Zugspitze. We even drove to St. Anton on one day (about 90 min away). There was plenty of space for our group: 4 adults and 3 kids.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Jessica','https://www.airbnb.de/rooms/19774742/reviews','Januar 2020'),
(1166,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','这是我这一程到目前定的最满意的民宿,虽然价格贵了些,但还是值得的｡ 公寓在三层,需要拎箱子上楼｡是个复式结构,上面有个小阁楼,下面两个卧室｡不过楼上并没有任何隔断,私密性要差一些｡楼下有两个阳台,可以悠闲地喝着咖啡仰望雪山｡果然楼上的窗户也能打开,可以从屋顶看整个村落｡ 从这里去楚格峰很方便,eibsee湖也很值得去看一看｡',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'人杰','https://www.airbnb.de/rooms/19774742/reviews','Dezember 2019'),
(1167,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Stay in this beautiful, clean, comfortable apartment if you have the opportunity! We enjoyed a hyggeligt holiday there in early December. The location is fantastic, with easy drives to Garmisch, Eibsee, the cog train or cable car up the Zeugspitze, Oberammergau, Ettal, and a day trip to Neuschwanstein. The Alpine views from the apartment are breath-taking. We visited in the off season and most of the restaurants in Grainau were closed, however Garmisch was a 10 minute drive and many places were open there. The host is very responsive and gracious. Check in was simple. Our 9 year old and 13 year old children loved sleeping in the loft and relaxing in the hammock chairs. The bathrooms were spacious and clean. We did not cook while there, but the kitchen was well-equipped. We enjoyed pastries from the bakery just across the square in the mornings before setting out on our adventure for the day. We also enjoyed a short hike up the foot of the Zeugspitze right behind the house with a lovely view of the town.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Alison','https://www.airbnb.de/rooms/19774742/reviews','Dezember 2019'),
