(1202,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','I can\'t convey the beauty of the surrounding views from the balconies at Peter\'s place. Surreal  may be the best word. This alone would be a reason to stay.\nHowever, Peter\'s place was also fantastic. It is spacious, clean, comfortable, and very close to everything you need. We enjoyed playing cards one evening at the large dining table. We also made a fire one evening when the weather changed. There are several bakeries in town with one being only about 50 meters from the house. The ATM is close (many places throughout Germany only accept cash), and multiple good restaurants.\nWe also visited Lake Eibsee,  the Partnach gorge, and Zugspitze by cable car. Each can\'t be missed. \nAs is well stated by Peter and other reviewers, this is on the top floor without an elevator. We had no problem with the stairs, but especially with luggage, this could be a problem for someone with mobility issues.\nLooking back, if we had extra days to spend on this trip, we would have chosen more in Grainau at Peter\'s place.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Charlotte','https://www.airbnb.de/rooms/19774742/reviews','September 2018'),
(1203,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','If AirBnB offered a six star rating, this place deserves it! The views from the apartment are stunning and the pictures don\'t do it justice. The space is impeccable, spacious, and very cozy. I couldn\'t have wished for more! Peter was a great host and made everything very easy for my group. I highly recommend a stay in Grainau!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Adrienne','https://www.airbnb.de/rooms/19774742/reviews','September 2018'),
