(1205,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Grainau is a place highly recommend to travel in Germany. If you plan to stay at Grainau, you need to choose Peter\'s house! The location and view is excellent here! The facilities are functionable and good, and spacious for us (4 people). The fireplace is fantastic for us as the temperature drops to about 12 degree with heavy rain during our stay. If I go to Grainau again, I will choose Peter\'s house=)',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Irene','https://www.airbnb.de/rooms/19774742/reviews','Juni 2018'),
