(1207,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The view from Peter’s place was absolutely gorgeous. Right at the foot of the Alps. The place was new, modern and very clean. Comfy beds, and info on things to do in the area. We could’ve used instructions on the coffee maker. The town was charming and there were several restaurants within steps from the place. Not a lot of cooking utensils/pots etc. Very enjoyable stay overall.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Anne','https://www.airbnb.de/rooms/19774742/reviews','März 2018'),
