(1209,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We stayed for almost three weeks, and got to enjoy this special place. It is well positioned for the keen skier and for those who\'d like to get away from the big city (and have a truly genuine alp village experience). Peter was a great host, and made sure we were welcomed and had the information we needed. Annika was always at hand in the house as well.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Mikael','https://www.airbnb.de/rooms/19774742/reviews','Januar 2018'),
(1210,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This apartment is everything and much more. The setting is straight out of a fairytale offering spectular views from every window. We spent Christmas here and did a lot of our own cooking. Everything was easy and great! Coffee machine is wonderful! Communication with Peter was excellent and swift. He was extremely helpful with tips and recommendations. We are a family of five and had plenty of room to stretch out and just relax in this comfy updated apartment.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Michelle','https://www.airbnb.de/rooms/19774742/reviews','Dezember 2017'),
