(1212,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wow, for a family of 6 adults, one child and one infant, I couldn\'t have asked for more. The instructions provided by the host for checkin, his quick responses on airbnb, and his local guidance was amazing. Will definitely take the place next time if i go there. 5 stars on the rating',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Nilesh','https://www.airbnb.de/rooms/19774742/reviews','September 2017'),
(1213,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Peter\'s place was fantastic! Absolutely gorgeous views abound and we spent so much time relaxing on the balconies soaking in the amazing scenery. We had a car, but the town was very walkable and everything we needed was nearby. Everyone in our group agreed that if we could change anything it would have been to stay at Peter\'s place and in Grainau longer. I would recommend or return to this awesome place for a future trip!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Heidi','https://www.airbnb.de/rooms/19774742/reviews','September 2017'),
(1214,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','这个房子特别赞,小木屋的装修风格,很温馨很漂亮,装饰的特别细致用心,几个阳台观景超级好｡厨房里设施非常全,床和房间也足够多,住起来很舒适｡关键是风景太美了｡我们这次旅程,大家都觉得在这里是睡的最舒服的一晚,完全是意外的惊喜｡我们觉得可以在这里住上一个星期｡',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Maggie','https://www.airbnb.de/rooms/19774742/reviews','September 2017'),
(1215,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This was a fabulous stay at a quaint location in Grainau. The place was beautiful and clean. Peter always responded quickly and check in was smooth. Hope to stay here again one day!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Jessica','https://www.airbnb.de/rooms/19774742/reviews','September 2017'),
(1216,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Our stay at Peter\'s place and our interactions with Peter were absolutely excellent. Communications with Peter were quick, accurate, and to the point, yet very personal. He was very responsive. As one example - in response to my concerns about potential warm weather, Peter went out and purchased fans! - which in the end proved unnecessary. We met Peter and his family, while we were there, and they were gracious and charming. The  the alpine house and our apartment were wonderful, and my wife and I and our 4 grand children loved it, particularly its adjacent proximity to the mountains and  amenities. There is also adjacent dedicated parking.  The town is beautiful and charmingly small with great restaurants, and it is quickly accessible to Garmisch, Eibsee, and the Zugpitze (Germany\'s tallest mountain complete with cog rail train and cable car access) along with easy and quick access to two well stocked food markets very close by. We walked to the local bakery almost every morning, which is less than a block down the street. The kids climbed the mountains, went swimming at the top-notch and very walk-able town community center, and were regulars at the local mini-golf course, which is also right down the street. It was a wonderful \"old world\" experience, complete with cows with their bells grazing on on the mountain and the traditional ringing church bell from the onion spire of the town church. I am not ordinarily a person who would give such a strong endorsement, but this was an experience that was truly outstanding. I have only one caveat - if you have any problem with mobility, particularly stairs, the apartment is two flights up, so, I would carefully consider this, otherwise, enjoy.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Jackson','https://www.airbnb.de/rooms/19774742/reviews','August 2017'),
