(1258,0,9,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We had a dream holiday, everything from location to comfort recommending this place as the perfect winter getaway in Bavaria. Access to ski and sledge slopes is in front of your balcony. You are at minutes distance of any major point of interest or winter resort from the area. The apartment is perfect for a family of 4, perfectly arranged with all you can think of in terms of furniture and appliances. The kids loved it and we felt like home. One thing that we found difficult at the beginning was access to a supermarket or restaurant, but as we accommodate with the town and the area, we realized everything was at a few minutes away of driving. Yes, you need a car to fully benefit of this place. We are already thinking at our next winter holiday to spend it here also.',4.71,NULL,0,0,'2021-04-10 16:35:36','2021-04-10 16:35:36',0,1,NULL,'Florin','https://www.airbnb.de/rooms/20719380/reviews','Februar 2019'),
