(1263,0,9,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','It was a quite and lovely place located in a picturesque town, right next time chair lift. However it’s recommended if you have your own car. Check in was smooth. There are couple of good restaurants in the downtown, we particularly loved the Italian restaurant which was right next to supermarket. We used it as a base station for going to different attractions i.e, fairytale castle, Munich, Füssen etc. The only issue was water heater capacity which was good for three showers but the strange thing was that once used, the hot water would be available next morning only.',4.71,NULL,0,0,'2021-04-10 16:35:36','2021-04-10 16:35:36',0,1,NULL,'Abdul Aleem','https://www.airbnb.de/rooms/20719380/reviews','Juni 2018'),
