(1567,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This is a wonderful place for travelers to stay during a trip to lovely Oberammergau. Dita is extremely courteous and helpful, offering us suggestions for hikes and other fun things to do while in town (try the Alpine Coaster!). The space itself is especially charming and clean—we felt comfortable there at once. There is one bedroom with (I think) a Queen size bed, and a pull out sofa bed that’s about the same size in the main room that also houses a sink, small stovetop, and fridge. The bathroom and shower room are very clean, and towels were provided. The shower is a bit low in height (I’m 6’1 and had to crouch a bit to fit under the shower head) but this is honestly a minor inconvenience unless you are especially tall (I think anyone 5’8 or under can fit in it without issue). The location is prime—a 1min wall from the bus stop, several grocery stores and shops are right across the street, perhaps 5 or so min from the town center with restaurants and shops, and walkable to many trailheads. Truly I can not recommend this lodging (and Oberammergau) enough!',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Harrison','https://www.airbnb.de/rooms/22523800/reviews','August 2019'),
(1568,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Très commodément placée entre Garmisch-Partenkirchen d\'un côté et le château de Neuschwanstein de l\'autre, à proximité du palais de Linderhof, la très belle maison de Dita offre de beaux espaces au deuxième étage. L\'équipement est suffisant et la décoration est sublime.',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Philippe-Aurèle','https://www.airbnb.de/rooms/22523800/reviews','August 2019'),
(1569,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','It’s not too large but very nice apartment in a one of the most beautiful old stylish villas in the town. Decorated with a great taste with art nouveau details and in whole dedicated to Mucha. It is a very calm surroundings so we slept very good. Liddl is just in front of the house, and all the historical famous buildings are just in five minutes. The town itself is very small so almost everything would be a centre)) but a special advantage was an rail alpine coaster that starts almost just behind the house (again, thank you, Dita, for the great advice!). Also it’s just 1 hour walking from the beautiful cloister of Ettal that definitely in the “must see” list. Dita is a wonderful host, hostile and attentive. Highly recommended!',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Olga','https://www.airbnb.de/rooms/22523800/reviews','Juli 2019'),
