(1578,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This was the best Airbnb I’ve stayed in. The apartment was even nicer than pictures and had a cozy feel. What really sold it was Dita’s hospitality. She lives on site and seeing we had two young daughters she had her children share some toys and books in English, which our girls loved playing with and reading. Dita gave us great tips on what to see and do and simply couldn’t have been a better host. The location was also fantastic. Across the street from grocery stores, one with a great cafe and excellent bread, and walking distance to everything in town. There is a great path along the river, which looked nice for a bike ride. The highlight was the alpine slide, which is the longest in Europe, and is basically right behind her house. We had a car and found her house to be a great jumping off point for many area highlights, including 3 of Ludwig’s castles Do not hesitate to book here!',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Nick','https://www.airbnb.de/rooms/22523800/reviews','Oktober 2018'),
