(1987,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Beautiful house all around in a country side setting. Large yard, fire pits, woods, and outdoor seating area are all very nice. The internet was about as expected of cable internet, fast enough downloads but fairly slow upload speeds.\n\nLike 5-10 minutes away from the little town with a few restaurants. ~1 hour away from a larger town. 30 minutes away from Canada.\n\nThe one dog is very lovely, the other takes some time to get used to you and is very energetic. There are apparently houses nearby that you can walk to see, but I did not get a chance to find them.',5,NULL,0,0,'2021-12-10 06:17:45','2021-12-10 06:17:45',0,1,NULL,'Kevin','https://www.airbnb.com/rooms/46443466/reviews','September 2021'),
(1988,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Staying at Jennifer\'s place was a real treat! The whole family is super friendly without being overbearing. Plenty of privacy in the thoughtfully appointed bedrooms if that\'s what\'s needed, and lovely chats over morning coffee as well.\nThe house is big and comfy and very clean. Being able to do laundry during my stay was quite helpful.\n\nJen and her family are quite knowledgeable about the area and have excellent advice on how to enjoy their little slice of heaven. If you\'re looking to get away from it all in a quiet town that somehow manages to have plenty to do, this is the place for you!!',5,NULL,0,0,'2021-12-10 06:17:45','2021-12-10 06:17:45',0,1,NULL,'Christine','https://www.airbnb.com/rooms/46443466/reviews','September 2021'),
(1989,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Jennifer and her husband were wonderful hosts! Their house and my sleeping space were more than I could have asked for, and their location is perfect for exploring the North Maine Woods. I hope to stay here again next summer.',5,NULL,0,0,'2021-12-10 06:17:45','2021-12-10 06:17:45',0,1,NULL,'Robert','https://www.airbnb.com/rooms/46443466/reviews','July 2021'),
(1990,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','If you\'re in Northern Maine and need a place to stay, look no further. I was initially a little apprehensive to stay in an AirBnB with the homeowners, but I\'m so glad I chose to. Their house and property is absolutely beautiful. We enjoyed meals together, laughed together, and I learned a lot about the area.\n\nThey were so welcoming and friendly and it was perfect. Plus I made some new friends in the process.',5,NULL,0,0,'2021-12-10 06:17:45','2021-12-10 06:17:45',0,1,NULL,'Stacee','https://www.airbnb.com/rooms/46443466/reviews','June 2021'),
