(2168,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Tolle Lage in Hammersbach, nahe Höllentalklamm und Seilbahnen. Allerdings nicht an der Piste wie in der Anzeige beschrieben. Tolle Aussicht vom Balkon. Netter Kontakt zur Vermieterin, Schlüsselübergabe reibungslos. Nahe der Zugspitzbahnhaltestelle. Super Ausgangspunkt für Wanderungen.\nAusstattung im Wohnzimmer gut, Küche und Schlafzimmer sehr klein, für 3-4 Erwachsene\neher nicht zu empfehlen. Kochen nicht gut möglich, da nur 2 Herdplatten, Kaffeemaschine nicht nutzbar.\nSchlafzimmer nichts für Menschen mit Platzangst oder Großgewachsene. Bad ist okay.\nPreis-Leistungs-Verhältnis nicht angemessen, deutlich zu teuer für die Ausstattung und Größe der Wohnung.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Christian','https://www.airbnb.de/rooms/21411333/reviews','Juli 2021'),
