(2170,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Schöne gemütliche Wohnung, die mit Liebe zum Detail eingerichtet ist und von der Einrichtung alles bietet, was eine Ferienwohnung braucht. Küche sehr klein aber alles vorhanden, was man zum täglichen Kochen braucht.\nLage in Hammersbach absolut top zum Wandern, da man alle Wanderwege und Talstationen der Alpspitz/Kreuzeckbahn zu Fuß erreicht.\nWir haben uns in einer Woche Wanderurlaub sehr wohl gefühlt und können die Unterkunft nur empfehlen.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Gloria','https://www.airbnb.de/rooms/21411333/reviews','September 2019'),
