(2175,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wir hatten einen super Aufenthalt in der zwar recht kleinen, aber gemütlichen und super angebundenen (5min. bis zur Zugspitzbahn) Wohnung! Die Kommunikation lief super. Vielen Dank für die unverzüglichen Rückmeldungen und Tipps!!',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Oliver','https://www.airbnb.de/rooms/21411333/reviews','Januar 2018'),
(2176,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Schöne Wohnung in super Lage mit schneller Anbindung an die Zahnradbahn und zu Einkaufsmöglichkeiten.\nUns empfing der sehr freundliche und flexible Hausmeister für die Schlüsselübergabe. Die Wohnung war gemütlich möbliert und verfügt über eine gute Ausstattung (Smart-TV,Radio,Kaffee,Tee,Salz/Pfeffer etc.).\nZu beachten ist,dass die Wohnung für 4 Personen sehr knapp bemessen ist. Ebenso wie das Klopapier. Im Bad fehlte die Seife und in der Küche das Spüli. Außerdem wäre es von Vorteil gewesen sich vorab anhand eines Fotos ein Bild von der Küche (sehr kleine Zeile mit kleinem Waschbecken, mobile Herdplatte und winziger Backofen) machen zu können.\nBeim Ausklappen der Schlafcouch fanden wir unter dem Teppich eine nicht unerhebliche Menge Sand.\nDie zur Verfügung gestellten Hotel-Schlappen sollten gewaschen oder ersetzt werden.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Mara','https://www.airbnb.de/rooms/21411333/reviews','Februar 2022'),
(2177,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Very very clean flat, with comfortable bed and excellent shower, and a sofa bed in the living room that fits two children comfortably. There is a small kitchen with almost everything to do from a good breakfast or an easy lunch. And the highlight of this place, the pleasant living room with a stunning view to the Alpspitze and other mountains, really cool. Location is fantastic, close to a train station (3 min walking) in Grainau (the flat is very quiet), driving you reach the crowded Garmisch-Partenkirchen in 10 min and have access to supermarkets, restaurants and the ski lifts. Is a 4 season place I would say. Communication was good and clear. Thank you Romy !',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Ernesto','https://www.airbnb.de/rooms/21411333/reviews','Februar 2020'),
(2178,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Good place for ones who want to ski in the area. Close to local train, which is 1 station to the ski area. Perfect for couples',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Andrei','https://www.airbnb.de/rooms/21411333/reviews','Februar 2020'),
(2179,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The apartment is suitable for 2 adults, can accommodate another 2 if the living room is equipped with a curtain (currently only half of the window is shedded with a curtain)',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Enyayaya','https://www.airbnb.de/rooms/21411333/reviews','Juni 2019'),
(2180,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Staying in Romy´s flat was like living in a fairytale...for a long weekend, anyway. The apartment is situated in Hammersbach, near Grainau, a perfectly small hamlet away from the craziness of G-P. It is quiet, peaceful, and bucolic. Beautiful walking trails are minutes from the door and the balcony delivers a stunning view of the Waxensteins. A little bit further away are the trails to Höllentalklamm and other trails that lead to Zugspitze. In fact, this flat is on the way to Zugspitze and Eibsee, so locationally, I thought it was perfect (you are also not far from the Bayerische Zugspitzbahn stop which takes you everywhere in the area). The flat itself was super cozy and perfectly equipped. While we are two smallish females, I could see where a tall person would feel claustrophobic due to the slant ceilings, but it worked for us. We wanted for nothing and this is the first AirBnB I’ve stayed in where I wouldn’t change a thing. Romy was very responsive and gave us tips on what to do in the area. I hope we can come back again!',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Cecilia','https://www.airbnb.de/rooms/21411333/reviews','April 2019'),
(2181,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We spent a hugely enjoyable 5 nights at Rommy\'s flat. Rather than stay in urban Garmisch, this place gives you a stupendous view of Zugspitze and Alpspitze. You are right underneath them and the lush surrounding forest. Listen for the sound of the stream when sitting on the balcony.\n\nIf you don\'t have a car like ourselves, you\'ll have to get your supplies from elsewhere as there isn\'t a supermarket you can pop out to (as far as I know). Shops down road in Grainau or next to Garmisch rail.\n\nAll in all, super place to stay.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Vik','https://www.airbnb.de/rooms/21411333/reviews','August 2019'),
