(2190,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Romy\'s home is very nice, the communication worked very well and the location is great if you are into skiing or hiking with the closest lifts just a 15-minute stroll away and train to other lifts even closer than that.\nThe flat has two drawbacks though, which makes me think the value is not fantastic. First, the heavily sloping walls can make life quite uncomfortable - I was literally unable to stand up in any part of the bedroom and bending over to cross the room is not necessarily what you want when your body aches from yesterday\'s skiing. Second, we experienced significant rain in the mountains (for which I am not going to blame Romy) and found no appropriate place to dry the wet skiing jackets and pants. If you bring your own skis and boots, space constraints are going to be even more of an issue.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Niels','https://www.airbnb.de/rooms/21411333/reviews','Januar 2018'),
(2423,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','What to say... This is art in architecture:) Was a pleasure to spend a night in this (bird)box for people!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Matej','https://www.airbnb.ca/rooms/34692739/reviews','May 2022'),
(2424,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Staying in this birdbox, in front of this stunning view makes you feel really calm and blessed for being there. It is an once in a lifetime experience sleeping and waking up deeply in the wild nature of Norway. Torstein had been a perfect host responding almost immediately to our messages. He even found a way to satisfy our desire to have a shower during our stay there. I wish that all hosts were like him.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Nikos','https://www.airbnb.ca/rooms/34692739/reviews','April 2022'),
(2425,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Clearly you book this place for the views and unique accommodation! Sunset was the best, and we didn’t realize there was a little campsite next to the Birdbox where you can use the firewood and grill dinner if you purchased groceries in town. The bathroom area is in the barn nearby, which is also where we kept our belongings since the Birdbox only has a few feet space outside of the bed. Be sure to bring only what you need in a backpack, as the Birdbox is 200 meters away from the parking area and can be steep if you’re trying to bring up any luggage. Bed was very comfortable with plenty of pillows and blankets, and heating was nice. Would recommend to anyone who also loved to drone—we took some amazing photography and video footage!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Laura','https://www.airbnb.ca/rooms/34692739/reviews','April 2022'),
