(2427,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Torstein\'s #birdbox is beautifully situated and offers a great view of the fjord. There is even a fireplace on the small veranda, which further enhances the whole experience. The interior is extremely comfortable and cosy.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Mario','https://www.airbnb.ca/rooms/34692739/reviews','March 2022'),
(2428,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Fairytale place! We really loved the location and the view, a fantastic place for a staycation away from home. Even though it was raining most of the time we still lit a bonfire in between the rainfall. It was magical. Torstein responded quickly to any request, gave clear instructions and sorted out a problem we had in a smooth manner. Some minor stuff in the Birdbox should be repaired for an even better impression - but the view and the calm of the place is wonderful and trumps it all. Recommend!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Linda','https://www.airbnb.ca/rooms/34692739/reviews','October 2021'),
