(2450,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Nothing worthwhile in life is easy. If you want something spectacular be prepared to put the effort in and you will not be disappointed.\n\nThe elegantly simple design of what is essentially a bedroom (no, there is not an en suite) sits proudly on a landscape but doesn’t compete or offend nature. This is a celebration of how beautiful Norway is and offers visitors the chance to lose themselves in wonder.\n\nThis is a place for one or maximum two people - it is just a large bed in a box. But what a place.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Alan','https://www.airbnb.ca/rooms/34692739/reviews','October 2020'),
