(2484,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We love unique airbnbs, so we booked this one :-) Our expectations have been exceeded, this place is truly unique and beautiful! Its a once in a lifetime experience. Watching the sunset and the moon during the night was amazing. Every morning we were woken up by some lovely sheep in front of our cabin and the cows were also very cute! The interior in the cabin is really comfy and it‘s protected from the wind. However pack some warm clothes because its getting quite cold there during the night (4 degree in august :-D) and some hiking shoes to get up there. Thorstein, thank you for building and offering such a great place to other people!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Gabi','https://www.airbnb.ca/rooms/34692739/reviews','August 2019'),
