(2612,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Fantastisk utsikt, skinnende rent, og kult konsept. Selve Birdbox\'en er veldig stilig, men den var mindre enn først forventet. Det blir også veldig varmt der inne når sola skinner. Vannet som sto på bordet var varmt, og vi måtte ha døren på gløtt om natta. Det er ikke noe sted å oppbevare matvarer som er avhengig av kjølig temperatur. Det er bare ett håndkle. Og varm mat må kokes eller stekes på primusen i fjøset. Så ble litt skuffet når vi hadde kjøpt med oss melk, smør og egg til frokosten. Ellers var oppholdet greit',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Henrik','https://www.airbnb.ca/rooms/34692739/reviews','July 2020'),
