(2633,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','10 av 10 på unik overnatting! Dette må du se! Det er godt skiltet underveis til gården, og ca 5-7 minutters gange fra parkeringsplassen.\nVi var der i februar og fikk en liten gjørmete vei til birdbox men når du kommer til toppen er turen verdt det. Den er liten og kompakt, men du har en herlig seng og en utsikt du ALDRI VIL GLEMME! Vann og stearinlys stod klart, samt utallige tepper for å holde oss varm. Vi hadde lest på forhånd at birdboxen kan opplevels kald så vi hadde gode klær, men det er nok tepper til å kle seg inn og bare kose seg!Verten svarte oss umiddelbart ved spørsmål og var opptatt av at vi skulle ha det bra. Selv med en stormfull natt (som var litt kjedelig når man må ut i det andre huset for å gå på toalettet midt på natten) hvor vi hørte alle vindkast og tordenvær - var opplevelsen noe vi aldri ville vært foruten. Selve stormen gjorde det bare spennende. I huset ved siden av har du toalett og mulighet til å lage kaffe.\nVi fikk en flott morgen dagen etter. Å se Norge våkne til sol og lys om morgen er magisk! Og det får du her!\nJeg tok med min mann på overraskelsestur hit, og den ble veldig godt imottatt.\nAnbefales på det sterkeste!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Anniken','https://www.airbnb.ca/rooms/34692739/reviews','February 2020'),
(2634,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','En opplevelse du sent vil glemme! ?\nFikk virkelig slappet av, ladet opp batteriene!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Eline','https://www.airbnb.ca/rooms/34692739/reviews','January 2020'),
(2635,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Hadde én natt i birdboksen. Fantastisk utsikt som var magisk å våkne til. De har noe å gå på ift. fasilitetene, men renger med at det fikses etter hvert. Lurt å ta med varme klær :-)',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Øyvind','https://www.airbnb.ca/rooms/34692739/reviews','January 2020'),
(2636,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Dette oppholdet var helt fantastisk. Ryddig, rent, og konseptet i seg selv er så unikt og gjennomført at oppholdet blir noe en ikke vil glemme. Dette er et sted jeg skal tilbake til om jeg får muligheten til det. Helt magisk.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Tord','https://www.airbnb.ca/rooms/34692739/reviews','January 2020'),
