(2645,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Het pad naar de Birdbox gaat het laatste stuk ietwat steil omhoog door de wei. Goed schoeisel is aan te raden. Er is water aanwezig en een brander met theepot om koffie en thee te kunnen maken. Ondanks dat het koud was in de Birdbox (er liggen extra plaids) hebben we genoten van de prachtige uitzichten. Kortom, een belevenis op zich. Zeker een aanrader.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Mariska','https://www.airbnb.ca/rooms/34692739/reviews','September 2019'),
