(2847,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Obwohl Elsa nicht vor Ort war, haben wir uns wahrgenommen gefühlt. Sie hat uns aus der Entfernung einen entspannten Check-In gestaltet und uns mit reichlichen Informationen „gefüttert“.\nNächstes Mal lernen, wir uns dann hoffentlich kennen. ;-) Die Lage ist wirklich super! Der Bahnhof & Restaurants sind in wenigen Minuten zu Fuß zu erreichen.\nIm Hochbett schlafen, ist aufregend und es war alles sehr sauber!',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Samira','https://www.airbnb.de/rooms/48268802/reviews','Oktober 2022'),
