(2912,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Ich habe eine tolle Zeit bei Elsa verbracht. Die Wohnung ist nur wenige Gehminuten von der Bushaltestelle und dem Bahnhof entfernt. Ganz in der Nähe eines Lebensmittelgeschäfts. Die Lage ist fantastisch. Elsa war jederzeit erreichbar, wenn ich Fragen hatte, ob es nun darum ging, meinen Weg zur Wohnung zu finden oder die Waschmaschine zu benutzen. Die Wohnung war sehr gemütlich und komfortabel, ich fühlte mich wie zu Hause. Leider habe ich Elsa und ihre Tochter nicht kennengelernt, vielleicht das nächste Mal!! Ich würde sehr empfehlen, während deiner Reise nach Garmisch-Partenkirchen bei Elsa zu wohnen!',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Shreya','https://www.airbnb.de/rooms/48268802/reviews','September 2022'),
