(2925,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Elsa war eine wunderbare Gastgeberin und sehr reaktionsschnell und hilfsbereit. Ihre Unterkunft ist schön und modern und hat schöne elektronische Jalousien, um einen erholsamen Schlaf zu bekommen.\nDieser Ort ist etwa 15 Gehminuten vom Hauptteil der Stadt mit Geschäften und Restaurants in Garmisch und nur ein oder zwei Blocks vom Bahnhof und einer anderen Gegend mit einigen Restaurants entfernt.\nWahrscheinlich Benutzerfehler, aber ich konnte die Waschmaschine nicht zum Laufen bringen, da Elsa während meines Aufenthalts nicht da war. Das wäre nur etwas, das du im Voraus besprechen solltest, wenn du weißt, dass du sie brauchen wirst. Trotzdem hat Elsa so hart mit mir gearbeitet, um mir zu helfen, es aus der Ferne zum Laufen zu bringen!',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Anna','https://www.airbnb.de/rooms/48268802/reviews','Juli 2022'),
