(2982,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great apartment with flair. One room with bathroom. Plenty of space. EVERYTHING you need is there. Johannes super friendly, communicative, ATTENTIVE. Great location in the old town. There\'s no better way. Highly recommended.',4.94,NULL,0,0,'2023-10-07 14:09:10','2023-10-07 14:09:10',0,1,NULL,'Raphael','https://www.airbnb.co.nz/rooms/37548154/reviews','September 2021'),
(2983,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Perfect place, perfect location, super nice host, this is airbnb at its very best!',4.94,NULL,0,0,'2023-10-07 14:09:10','2023-10-07 14:09:10',0,1,NULL,'Adam','https://www.airbnb.co.nz/rooms/37548154/reviews','September 2021'),
(2984,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wonderfully suitable for a city trip, as the apartment is centrally located yet away from the hustle and bustle.\nIt has everything you need, good restaurants, shopping and the Danube are around the corner.\nCommunication was straightforward and the reception very nice. We would definitely come back !',4.94,NULL,0,0,'2023-10-07 14:09:10','2023-10-07 14:09:10',0,1,NULL,'Kerstin','https://www.airbnb.co.nz/rooms/37548154/reviews','September 2021'),
(2985,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Johannes and Daniela are wonderful hosts. Uncomplicated communication and a feel-good apartment in the heart of Regensburg make the stay perfect. Really highly recommended - thanks!',4.94,NULL,0,0,'2023-10-07 14:09:10','2023-10-07 14:09:10',0,1,NULL,'Helga','https://www.airbnb.co.nz/rooms/37548154/reviews','September 2021'),
(2986,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Very nice small apartment with a top central location and everything you ever need. We had a nice few days in Regensburg.',4.94,NULL,0,0,'2023-10-07 14:09:10','2023-10-07 14:09:10',0,1,NULL,'Joshua','https://www.airbnb.co.nz/rooms/37548154/reviews','September 2021'),
(2987,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Super centrally located and cozy small apartment on the ground floor. You are immediately in the old town.\nJohannes and Daniela are also very nice and are at your disposal for questions.\nThe apartment is well appointed and clean, we will be happy to come back!',4.94,NULL,0,0,'2023-10-07 14:09:10','2023-10-07 14:09:10',0,1,NULL,'Mika','https://www.airbnb.co.nz/rooms/37548154/reviews','August 2021'),
(2988,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Top location, very friendly hosts, apartment has everything you need, even a washing machine and a coffee machine for shared use. Small touches like a super delicious chocolate and nibbles make a difference. Thanks for that :)',4.94,NULL,0,0,'2023-10-07 14:09:10','2023-10-07 14:09:10',0,1,NULL,'Pia','https://www.airbnb.co.nz/rooms/37548154/reviews','August 2021'),
(2989,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We stayed in Regensburg for a week. Johannes\' apartment was exactly as described and is nicely centrally located in the middle of Old Town. We felt very comfortable.',4.94,NULL,0,0,'2023-10-07 14:09:10','2023-10-07 14:09:10',0,1,NULL,'Anna','https://www.airbnb.co.nz/rooms/37548154/reviews','October 2020'),
(2990,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','In the middle of the city and yet quiet - great',4.94,NULL,0,0,'2023-10-07 14:09:10','2023-10-07 14:09:10',0,1,NULL,'Peter','https://www.airbnb.co.nz/rooms/37548154/reviews','September 2020'),
(2991,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Nice little apartment in the middle of the city center. Everything is within walking distance. Lovingly furnished.',4.94,NULL,0,0,'2023-10-07 14:09:10','2023-10-07 14:09:10',0,1,NULL,'Cédric','https://www.airbnb.co.nz/rooms/37548154/reviews','September 2020'),
(2992,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Super location, good value for money. Johannes could set the price higher because of the super location and spacious flat. Anything you need is present. Johannes responds quickly to messages, is a superhost.',4.94,NULL,0,0,'2023-10-07 14:09:10','2023-10-07 14:09:10',0,1,NULL,'Helma','https://www.airbnb.co.nz/rooms/37548154/reviews','August 2019');
