(1031,2,'66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Lobbyismus, Lobbying oder Lobbyarbeit ist eine aus dem Englischen (lobbying) übernommene Bezeichnung für Interessenvertretung in Politik und Gesellschaft, bei der Interessengruppen („Lobbys“) – vor allem durch die Pflege persönlicher Verbindungen – die Exekutive, die Legislative zu beeinflussen versuchen.[1][2] Außerdem wirkt Lobbying auf die öffentliche Meinung durch Öffentlichkeitsarbeit ein. Dies geschieht vor allem mittels der Massenmedien.[3] Gängige Bezeichnungen für Lobbyarbeit sind zum Beispiel Public Affairs, politische Kommunikation und Politikberatung. Unternehmen und Organisationen unterhalten bisweilen ein Hauptstadtbüro oder eine Hauptstadtrepräsentanz, aber auch Büros bei den Landesregierungen.\n\nLobbying ist ein Aspekt des öffentlichen politischen Entscheidungsprozesses in Demokratien und ist nicht per se eine unmoralische Praxis. Das Herantragen von Interessen an Entscheidungsträger gehört zum Wesensmerkmal parlamentarischer Demokratie[4] und lässt sich dem intermediären Bereich zwischen Bürger und Staat[5] zuordnen. Um Entscheidungen im Gesamtinteresse der Gesellschaft treffen zu können, müssen Politiker sich über hochkomplexe Fragestellungen und Inhalte informieren. Dabei sind sie auf gut aufbereitete Informationen und Argumente verschiedener Interessengruppen angewiesen. Vice versa gehen Interessensvertretungen mit den Politikern in den Dialog, um politische Entscheidungsprozesse zu beeinflussen.\n\nKritisch wird angemerkt, dass Lobbyismus nur bei Einhaltung von regulierenden Verhaltenskodizes[6] oder möglichst großer Transparenz[7] positive Auswirkungen auf die demokratische Qualität eines Staates hat. Insbesondere durch regelmäßig bekannt werdende Lobbyismus-Affären (kurz Lobby-Affären) wird das idealtypische Bild von Lobbyismus getrübt. In diesen werden in der Regel Politiker in Machtpositionen von Unternehmen mit Geld bestochen, um Politik im Sinne der Geldgeber zu machen. In solchen Fällen ist Lobbyismus eine Form von Korruption.\n\nDer Begriff Lobbyismus hat daher häufig eine negative Konnotation, sodass Lobbyisten selten unter diesem Begriff auftreten, sondern stattdessen euphemistische Bezeichnungen wie Consultant, Public Affairs Manager oder Policy Advisor verwenden.[8]\n\nLobbyismus wurde in Anlehnung an die „Vierte Gewalt“ (Medien) auch als „Fünfte Gewalt“ bezeichnet, da Medien einen öffentlichen Einfluss, die Interessenpolitik jedoch oft einen unbemerkten Einfluss auf die Gesellschaft und insbesondere die Staatsgewalt hat. ',1,'message',NULL,NULL,0,'2021-10-21 04:43:05','2021-11-06 16:04:43',NULL,NULL),
